INSERT INTO `logro` (`idLogro`, `periodo`, `idGrado`, `idMateria`, `superior`, `alto`, `basico`, `bajo`) VALUES
(1, 'PRIMERO', '6', 'CAS', NULL, NULL, NULL, NULL),
(2, 'PRIMERO', '8', 'ALG1', 'Reconoce con mucha facilidad las expresiones algebraicas, encuentra el valor numérico y reduce términos semejantes. Felicitaciones.', 'Reconoce con  facilidad las expresiones algebraicas, encuentra el valor numérico y reduce términos semejantes. Participe más de las actividades en el aula de clases.', 'Algunas veces reconoce las expresiones algebraicas, encuentra el valor numérico y reduce términos semejantes.. Si se dedica mas obtendrá mejor rendimiento', 'Demuestra dificultades en reconocer las expresiones algebraicas, encontrar el valor numérico y reducir términos semejantes Debe dedicarse más a la asignatura.  '),
(3, 'PRIMERO', '9', 'ALG2', 'Reconoce  con mucha facilidad  los sistemas de ecuaciones lineales y utiliza los métodos eficientemente para encontrar el conjunto solución. Felicitaciones.', 'Reconoce  con  facilidad  los sistemas de ecuaciones lineales y utiliza los métodos  para encontrar el conjunto solución.  Participe más de las actividades en clases', 'Algunas veces reconoce   los sistemas de ecuaciones lineales y se le dificulta  utilizar los métodos  para encontrar el conjunto solución.  Si se dedica más obtendrá mejor rendimiento', 'Requiere de mucho esfuerzo para  reconocer  los sistemas de ecuaciones lineales y no tiene claridad en aplicar los métodos para encontrar el conjunto solución.  Debe dedicarse más a la asignatura.  '),
(4, 'PRIMERO', '5', 'CL', 'identifica con mucha facilidad los conceptos de signos de puntuación su desenvolvimiento fue bueno ', 'identifica con facilidad los conceptos de los signos de puntuación dedíquese u poco mas ', 'en algunas ocasiones identifica los conceptos de los signos de puntuacion con un poco de esfuerzos hubiese conseguido mejores  resultados', 'muy pocas veces identifica los conceptos de los signos de puntuación este es el resultado de no haberse dedicado '),
(5, 'PRIMERO', '9', 'COMCI', 'Identifica  de manera clara los dilemas de la vida en los que distintos derechos y valores entran en conflicto y analiza posibles opciones de solución. Es atento de la asignatura', 'Identifica  los dilemas de la vida en los que distintos derechos y valores entran en conflicto y analiza posibles opciones de solución. Presenta buena actitud en clase', 'Identifica en ciertas ocasiones los dilemas de la vida en los que distintos derechos y valores entran en conflicto. Debes ser mas dedicado a tu estudio.', 'Poca veces  Identifica  los dilemas de la vida en los que distintos derechos y valores entran en conflicto y rara vez busca opciones de solución Presenta buena actitud negativa y distractora  en clase.'),
(6, 'PRIMERO', '6', 'ING5', 'Utiliza con amplitud la temática del verbo “to be”, números en ingles, los adjetivos posesivos “there is, there are”; por medio de excelente actividades aplicadas a la realidad en que vive. Excelente trabajo ', 'Apropia gran parte de la temática del verbo “to be”, los números en inglés, números en ingles, adjetivos posesivos “there is, there are”; por medio de la realización de actividades. Dedíquese un poco mas.', 'En determinados casos hace uso de la temática del verbo “to be”, los números en inglés, adjetivos posesivos “there is- there are”; con algunas dificultades realiza actividades. Necesita refuerzo en los temas visto', 'Requiere de mucho esfuerzo para hacer uso de la temática del verbo “to be”, los números en inglés, adjetivos posesivos “there is- there are”; realiza con dificultades las actividades.Podría mejorar si se esfuerza.'),
(7, 'PRIMERO', '6', 'ARIT1', 'Aplica correctamente los conectores lógicos formando proposiciones compuesta encontrando los valores de verdad, además realiza operaciones entre conjuntos  sigue así y pronto alcanzaras el éxito', 'Cumple adecuadamente con trabajos y tareas y muestras dificultades en algunos temas si te lo propones puedes llegar a la excelencia', 'Pocas veces aplica los conectores lógicos y confunde las operaciones entre conjuntos demostrando en ocasiones dudas de sus conocimientos, alcanzando a superar algunos logros. Animo puedes ser mejor', 'Demuestra dificultades para realizar tablas de verdad, y no maneja las operaciones entre conjuntos, además es irresponsable con trabajos y tareas y no demuestra interés por la asignatura, debes mostrar mas interes'),
(8, 'PRIMERO', '6', 'EST', 'Maneja con alto dominio las encuestas organizándolos de manera precisa en una tabla  realizando el conteo y hallando su frecuencia aplicándolas en un diagrama de barras, felicidades ', 'Demuestra actitudes por aprender a organizar los datos de una encuesta y organizarlos en una tabla de frecuencia, aunque a veces falla aplicando el diagrama de barras. Con un poco mas de esfuerzo puedes ser excele', 'Son pocos sus esfuerzo para realizar la encuesta y organizarla en la tabla de frecuencia siendo impreciso a la hora de realizar  el diagrama de barras debes tratar de mejorar para alcanzar los logros completamente', 'Aporta poco en la clase y es tan grande su desinterés por la signatura que no presenta trabajos ni tareas ni aplica los valores siendo intolerante con el compañero'),
(9, 'PRIMERO', '7', 'ARIT2', 'Domina totalmente las operaciones con números enteros y sus propiedades ubicándolas de manera precisa en la recta numérica su comportamiento es bueno y alcanza totalmente los logros. Felicitaciones', 'Corresponde al trabajo asignado en la clase, presentando tareas y trabajos de manera oportuna, pero presenta dificultades en algunos temas que no le permiten superar todos los logros.', 'Cumple algunas veces con trabajos y tareas asignadas, además se muestra distraído a las explicaciones del profesor, el cual no le permite superar algunos logros. Debes demostrar más interés por aprender', 'Sus participaciones son muy pobres en clases mostrando limitaciones para alcanzar los logros propuesto, su desinterés por aprender lo puede llevarte a repetir el grado'),
(10, 'PRIMERO', '7', 'EST', 'Maneja con alto dominio las encuestas identificando la población y la muestra organizándolos de manera precisa en una tabla de frecuencia  hallando frecuencia absoluta frecuencia relativa y porcentajes ', 'Demuestra actitudes por aprender a organizar los datos de una encuesta, en una tabla de frecuencia, aunque a veces falla en los porcentajes. Con un poco mas de esfuerzo puedes alcanzar todos los logros ', 'Son pocos sus esfuerzos para realizar la encuesta y organizarla en la tabla de frecuencia siendo impreciso a la hora de hallar la frecuencia relativa. Debes tratar de mejorar para alcanzar los logros ', 'Aporta poco en la clase y es tan grande su desinterés por la signatura que no presenta trabajos ni tareas ni aplica los valores siendo intolerante con el compañero'),
(11, 'PRIMERO', '7', 'GEO', 'Construye con precisión rectas paralelas y perpendiculares con escuadra, reconociendo la geometría como una rama importante en la matemática. Su comportamiento es excelente éxitos', 'Cumple con la mayor parte de lo propuesto aunque a veces se le dificulta superar algunos temas que no le permiten alcanzar la superioridad. Animo con más empeño llegaras a la excelencia', 'Son pocos sus esfuerzos por aprender lo propuesto en la asignatura de manera regular alcanza los logros. Debes tratar de demostrar más interés por la asignatura', 'Aporta poco en la clase no investiga, no pregunta, no interviene en nada que tenga que ver con la clase su desinterés por la asignatura es notorio '),
(12, 'PRIMERO', '7', 'COMP', 'su comportamiento  es excelente aplicando el manual de convivencia y cumpliendo con las laboras académicas, respetando a sus compañeros y profesores aplicando la tolerancia y otros valores. felicidades', 'su comportamiento es bueno respetando a sus profesores y compañeros aunque aveces no cumple lo establecido en el manual de convivencia con mas entusiasmo puedes llegar a la superioridad', 'su comportamiento es regular mostrando por momentos brotes de indisciplina con sus compañeros, involucrandose en desordenes dentro y fuera del aula de clases. debes mejorar para los siguientes periodos', 'su constante indisciplina y desordenes con compañeros dentro y fuera del aula de clase lo llevan a un rendimiento académico bajo debes mejorar tu actitud y ser mas responsable con la academia'),
(13, 'PRIMERO', '8', 'EST', 'Maneja con alto dominio las encuestas identificando la población y la muestra organizándolos de manera precisa en una tabla de frecuencia  hallando frecuencia absoluta frecuencia relativa y porcentajes.Felicidades', 'Demuestra actitudes por aprender a organizar los datos de una encuesta, en una tabla de frecuencia, aunque a veces falla en los porcentajes y en las variables aleatorias. Animo puedes ser superior', 'Son pocos sus esfuerzos para realizar la encuesta y organizarla en la tabla de frecuencia siendo impreciso a la hora de hallar la frecuencia relativa y lo confunde las variables aleatorias. Debes tratar de mejorar', 'Aporta poco en la clase y es tan grande su desinterés por la signatura que no presenta trabajos ni tareas ni aplica los valores siendo intolerante con los compañeros'),
(14, 'PRIMERO', '4', 'AMB', 'Fácilmente caracteriza  ecosistemas  y describe los niveles de organización ecológica de los seres vivos. ¡Felicitaciones!', 'Frecuentemente caracteriza  ecosistemas  y describe los niveles de organización ecológica de los seres vivos.Continúa avanzando cada día más!', 'En determinados casos caracteriza  ecosistemas  y describe los niveles de organización ecológica de los seres vivos.Te animo a mejorar día a día, tú puedes!', 'Muestra inseguridad para caracterizar  ecosistemas  y describir los niveles de organización ecológica de los seres vivos.Te invito a trabajar en clase y ser más responsable para que puedas mejorar tu rendimiento!'),
(15, 'PRIMERO', '7', 'ING5', 'Utiliza con amplitud la temática del presente continuo, el modal “can y cannot”y comprensión de lecturas; por medio de la excelente realización de actividades. Se le recomienda no bajar la guardia.', 'Apropia gran parte  del presente continuo, el modal “can y cannot”, y comprensión de lecturas; por medio de la realización de actividades. Se le recomienda continuar esforzándose para lograr la excelencia.', 'En determinados casos hace uso  del presente continuo, el modal “can y cannot” y comprensión de lecturas; con dificultad realiza actividades. Necesita refuerzo en los temas vistos.', 'Requiere de mucho esfuerzo para hacer uso  del  presente continuo, el modal “can y cannot”, y comprensión de lecturas; realiza con mucha dificultad las actividades. Podría mejorar si se esfuerza un poco más.'),
(16, 'PRIMERO', '8', 'ING5', 'Utiliza con amplitud la temática del presente simple, con excelente; realización de preguntas estructuradas con WH-question aplicadas a actividades diarias. Excelente trabajo!', 'Apropia gran parte de la temática del presente simple, realizando preguntas estructuradas con WH-question aplicadas a actividades diarias.   Siga  esforzándose para lograr la excelencia.', 'En determinados casos hace uso de la temática del presente simple; realizando con algunas dificultades preguntas estructuradas con WH-question aplicadas a gustos e intereses. Necesita refuerzo en los temas vistos.', 'Requiere de mucho esfuerzo para hacer uso de la temática del presente simple; realizando con muchas dificultades preguntas estructuradas con WH-question aplicadas a actividades diarias. Esfuérzate un poco mas.'),
(17, 'SEGUNDO', '6', 'ING5', 'Construye con precisión su conocimiento acerca de los miembros de la familia, posesivo anglo sajón (‘s), adjetivos demostrativos “that, this, those, these”; aplicándolos con mucha facilidad. Felicitaciones', 'Hace buen uso de los miembros de la familia, posesivo anglo sajón (‘s), adjetivos demostrativos “that, this, those, these”; aplicándolos con mucha facilidad a su cotidianidad. dedíquese un poco mas.', 'Maneja moderadamente los miembros de la familia,  posesivo anglo sajón (‘s),adjetivos demostrativos “that, this, those, these”; aplicándolos con mucha dificultad a su cotidianidad Se le recomienda preocuparse más.', 'Desarrolla con poca precisión los miembros de la familia, posesivo anglo sajón (‘s), adjetivos demostrativos “that, this, those, these”; aplicándolos con mucha falencias a su cotidianidad. Debe dedicarse mas.'),
(18, 'TERCERO', '6', 'ING5', 'Maneja con alto dominio la temática referente a los sustantivos contables-no contables, las expresiones de cantidad “Some y Any”,  los verbos “Have-Has”; realizando excelente ejercicios de aplicación. Felicitacion', 'Generalmente aplica la temática referente a los sustantivos contables-no contables, las expresiones de cantidad “Some y Any”,  los verbos “Have-Has”; realizando ejercicios de aplicación. Dedíquese mas . ', 'Algunas veces se preocupa por aprehenderse la temática de los sustantivos contables-no contables, las expresiones de cantidad “Some y Any”,  los verbos “Have-Has”;con dificultad realiza actividades. Esfuérzate mas', 'Expresa sin claridad la temática referente a los sustantivos contables-no contables,las expresiones de cantidad “Some-Any”,  los verbos “Have-Has”; realizando con falencias ejercicios de aplicación. Esfuerzate mas'),
(19, 'CUARTO', '6', 'ING5', 'Se distingue por conocer  correctamente los adverbios de frecuencia, los objetos pronombres, partes del cuerpo y los comparativos “as…as”; aplicándolos acertadamente a situaciones cotidianas. Felicitaciones', 'Actúa apropiadamente respecto a los adverbios de frecuencia, los objetos pronombres, partes del cuerpo y los comparativos “as…as”; aplicándolos a situaciones cotidianas. Se le recomienda un poco más de empeño.', 'Presenta falencias en los adverbios de frecuencia, los objetos pronombres, partes del cuerpo y los comparativos “as…as”; aplicándolos con algunas dificultades  a situaciones cotidianas. Esfuérzate mas', 'Demuestras dificultades en los adverbios de frecuencia, los objetos pronombres, partes del cuerpo y los comparativos “as…as”; aplicándolos con muchas falencias a situaciones cotidianas. Requiere mas compromiso.'),
