(21, 'TERCERO', '7', 'ING5', 'Maneja con alto dominio la temática referente al vocabulario del pasado, los verbos regulares e irregulares, “feelings”, lecturas y los sistemas de transportes; realizando excelente actividades. Felicitaciones', 'Corresponde al trabajo de la temática referente al  vocabulario del pasado, los verbos regulares e irregulares,“feelings”,lecturas y los sistemas de transportes; realizando ejercicios de aplicación. Esfuérzate mas', 'en algunas ocasiones identifica el vocabulario del pasado, los verbos regulares-irregulares,feelings”, lecturas y los sistemas de transportes;tiene algunas falencias con los ejercicios de aplicación.preocupese mas', 'Expresa sin claridad la temática referente al vocabulario del pasado, los verbos regulares-irregulares,“feelings”, lecturas y los sistemas de transportes;realizando con muchas falencias actividades.Esfuerzate mas.'),
