(24, 'TERCERO', '8', 'ING5', 'Desarrolla excelentemente el uso del pasado continuo, going to y will; aplicándolos con mucha facilidad al contexto requerido. Felicitaciones por su aprovechamiento en la asignatura.', 'Corresponde al trabajo de la temática referente al pasado continuo, going to y will; aplicándolos con facilidad al contexto requerido.  Demuestra buenas actitudes en el trabajo', '. Son pocos sus esfuerzos por aprenderse la temática del pasado continuo, going to y will;  realizando con algunas falencias ejercicios de aplicación en el contexto requerido. Se le recomienda tener más confianza.', 'Demuestra dificultades para desarrollar la temática del pasado continuo, going to and will; realizando con muchas falencias ejercicios de aplicación. Debe dedicarse un poco más al estudio.'),
(25, 'CUARTO', '8', 'ING5', 'Maneja con alto dominio los modales can, can´t, could , superlatives y demostrtives; aplicándolos acertadamente a situaciones pasadas. Felicitaciones por su rendimiento académico.', 'Generalmente aplica los modales can, can´t, could , superlatives y demostrtives; aplicándolos a situaciones pasadas. Se le recomienda un poco más de empeño para llegar a un nivel superior.', 'Reconoce pocas veces los modales can, can´t, could , superlatives y demostrtives; aplicándolos con pocas dificultades a situaciones pasadas. Debe tomar conciencia de su rendimiento académico para mejorar.', 'Requiere de mucho esfuerzo para el uso de los modales can, can´t, could , superlatives y demostrtives; aplicándolos con muchas falencias a situaciones pasadas. Requiere de mucho esfuerzo para alcanzar los logros.'),
