(89, 'PRIMERO', '5', 'COMCI', 'Maneja con alto dominio los conceptos de:Estado,democracia y constitución política de Colombia y los aplica excelentemente en la solución de actividades y problemas de la vida diaria.Su desenvolvimiento fue bueno ', 'Frecuentemente maneja los conceptos de: Estado, democracia y la constitución política de Colombia y los aplica en la solución de actividades y problemas de la vida diaria. Dedíquese un poco más', 'Tiene poca capacidad para manejar los conceptos de:Estado,democracia y la constitución política de Colombia.Se le dificulta aplicarlos en actividades y problemas de la vida diaria. Esfuérzate un poco mas ', 'Su actitud es limitada para manejar los conceptos de:Estado,democracia y la constitución política de Colombia Y no tiene claridad para aplicarlos en las actividades. Este es por no haberse dedicado a la asignatura'),
(90, 'PRIMERO', '5', 'LCOM', 'Se destaca por reconocer estructuras del texto,buscando significados de palabras, expresiones y oraciones relacionada con la lectura. Empleándolo excelentemente en actividades trabajada en clase. Felicitaciones', 'De manera apropiada reconoce estructuras de textos, busca significados de palabras, expresiones y oraciones relacionadas con la lectura.Empleándolo en actividades trabajadas en el aula de clase debes dedicarte mas', 'Pocas veces reconoce estructuras de textos,buscar significados de palabras,expresiones y oraciones relacionadas con la lectura.Se le dificulta emplearlos en actividades trabajadas en clase. Esfuérzate mas  ', 'Demuestra dificultad para reconocer estructuras de texto,buscar significados de palabras,expresiones y oraciones relacionadas con la lectura.No tiene claridad para emplearlos en actividades.Dedíquese un poco mas. '),
(91, 'PRIMERO', '5', 'SOC4', 'Se destaca por reconocer la representación de los mapas,elementos y tipos de mapas que existen,el clima y relieve colombiano. Empleándolo excelentemente en actividades trabajada en clase. Su manejo fue bueno ', 'De manera apropiada reconoce la representación de los mapas, los elementos y tipos de mapas que existen,el clima y relieve colombiano. Empleándolo en actividades  trabajadas en el aula de clase debes dedicarte mas', 'Pocas veces reconoce la representación de los mapas,los elementos y tipos de mapas que existen,el clima y relieve colombiano.  Se le dificulta emplearlos en actividades trabajadas en clase. Esfuérzate un poco mas ', 'Demuestra dificultad para reconocer la representación de los mapas,elementos y tipos de mapas,clima y relieve colombiano.No tiene claridad para emplearlos en actividades trabajadas en clase. preocúpate un poco mas'),
