(102, 'PRIMERO', '2', 'AMB', ' Define con facilidad el concepto de medio ambiente y reconoce la importancia del reciclaje para mantener un ambiente limpio y sano. !Felicitaciones¡.', 'Define el concepto de medio ambiente y reconoce la importancia del reciclaje para mantener un ambiente limpio y sano. Un poco mas de esfuerzo y lograras la excelencia. ¡Felicitaciones!. ', 'Por lo general define el concepto de medio ambiente y reconoce la importancia del reciclaje para mantener un ambiente limpio y sano. Tu eres muy inteligente y si te lo propones te ira mucho mejor. ¡Animate!', 'Se le dificulta definir el concepto de medio ambiente y reconocer la importancia del reciclaje para mantener un ambiente limpio y sano. Deja la pereza, esfuerzate un poco mas y de seguro te ira bien.'),
(103, 'PRIMERO', '2', 'CL', 'Se distingue porque lee comprensivamente y relaciona cada texto leído con su realidad cotidiana. ¡Felicitaciones!', 'Generalmente lee comprensivamente y relaciona cada texto leído con su realidad cotidiana.  !Felicitaciones!', ' Aveces lee comprensivamente y relaciona cada texto leído con su realidad cotidiana.  Has demostrado ser muy inteligente y si te esfuerzas un poco mas superaras esta dificultad. ¡Animo tu puedes!', 'Demuestra dificultad para leer comprensivamente y relacionar cada texto leído con su realidad cotidiana. tu eres muy inteligente, solo propontelo y en proximo periodo seguramente te ira mejor. ¡Pilas tu puedes!'),
(104, 'PRIMERO', '2', 'CN', 'Identifica fácilmente el cuerpo humano y señala sus partes, cada uno de los órganos de los sentidos, el gusto, el olfato, el oido, la vista y el tacto, el concepto de locomoción y como está conformado .           ', 'Generalmente identifica el cuerpo humano y señala sus partes, cada uno de los órganos de los sentidos, el gusto, el  olfato, el oido, la vista y el tacto, el concepto de locomoción y como está conformado. ', 'Algunas veces identifica el concepto de cuerpo humano señalando sus partes, cada uno de los órganos de los sentidos  el gusto, el olfato, el oído, la vista y el tacto y el concepto de locomoción.', 'Muy pocas veces identifica el concepto de cuerpo humano señalando sus partes, cada uno   de los órganos de los sentidos, el gusto, el olfato, el oido, la vista y el tacto y el concepto de locomoción.'),
(105, 'PRIMERO', '11', 'EST', 'Domina totalmente los temas de población y muestra, las organiza de manera precisa y aplica correctamente las formulas para obtener resultados específicos acerca de la población de estudio. Felicidades.', 'Generalmente maneja los temas de población y muestra, mostrando dificultades en  la interpretación de los resultados. Con esfuerzo y dedicación lograras la excelencia.', 'En determinados casos resolvió los problemas de población y muestra de forma correcta, demostrando poco interés para la interpretación de resultados y solución de problemas, muestra desinterés en la clase. Animo.', 'Requiere de mucho esfuerzo para hacer aportes en clase y desarrollar de forma correcta las actividades asignadas, no presenta trabajos ni tareas a tiempo. Debes tratar de mejorar para alcanzar los logros.'),
(106, 'PRIMERO', '1', 'COMP', 'Se distingue  porque su comportamiento  dentro  y  fuera  del salón de clases  es  excelente.', 'Su  comportamiento  fuera  y  dentro  del  salón  de  clases  es  bueno.', '', ''),
(107, 'PRIMERO', '10', 'EST', 'Se apropia perfectamente de los conceptos de estadística, tipos de variables, población y muestra, aplicándolos correctamente en la solución de problemas de la vida cotidiana. Es brillante en sus aportes.', 'Interpreta de manera adecuada los conceptos de estadística, tipos de variables, población y muestra, presentando fallas en la aplicación de algunas formulas. Esforzándote un poco lograras la excelencia.', 'Maneja moderadamente los conceptos de estadística, tipos de variables, población y muestra, en determinados casos aplica de manera correcta las formulas. Animo.', 'Presenta poco interés en la realización de las actividades, sus habilidades con los problemas son muy limitadas. Esfuérzate un poco mas y veras mejores resultados.'),
(108, 'PRIMERO', '9', 'EST', 'Maneja y aplica correctamente los temas y conceptos de variables población y muestra. Sigue así.', 'Cumple con la mayoría de las actividades asignadas, mostrando interés en clase y buen comportamiento. Refuerza lo aprendido para alcanzar el nivel superior.', 'Algunas veces se preocupa por participar en clase y resolver los ejercicios asignados, pero supera satisfactoriamente la mitad de los logros esperados. Sigue trabajando, esfuérzate un poco más.', 'Desarrolla con poca precisión los logros trazados en la asignatura, en la resolución de problemas y aplicación de conceptos. Su desinterés e indisciplina le ha afectado en gran medida su rendimiento académico.'),
(109, 'PRIMERO', '9', 'GEO', 'Se destaca por manejar los conceptos básicos de la geometría euclidiana, construyendo rectas paralelas , además realiza problemas de aplicación con los ángulos complementarios y suplementarios por defecto,exceso ', 'Generalmente aplica los conceptos básicos de la geometría euclidiana, construyendo con acierto rectas paralelas y perpendiculares, demuestra interés por aprender  con más dedicación llegaras a la superioridad', 'Presenta con dificultades trabajos y tareas dudando siempre de sus conocimientos Si te lo propones puedes superar las dificultades. Animo ', 'Su desinterés es tan grande por la asignatura que no presenta trabajos ni tareas, olvidando el compromiso con el estudio, su bajo rendimiento académico y su indisciplina pueden llevarlo a repetir el grado'),
(110, 'PRIMERO', '2', 'ET', 'Se destaca porque explica con facilidad  el concepto de ética y de valores y reconoce la importancia de establecer y cumplir las normas para convivir con las demás personas. Felicitaciones.', 'Por lo general explica el concepto de ética y de valores, ademas reconoce la importancia de establecer y cumplir normas para convivir con las demás personas. Con solo un poco de esfuerzo llegaras a la excelencia.', 'Algunas veces explica el concepto de ética y de valores y reconoce la importancia de establecer y cumplir  las normas para convivir con los demás. Si te esmeras un poco seguramente te ira mucho mejor. !Animate!', 'Se le dificulta explicar el concepto de ética y de valores y reconocer la importancia de establecer  y cumplir normas para convivir con los demas. Si te lo propones te ira mejor, tu eres muy inteligente.  Animate!'),
(111, 'PRIMERO', '9', 'INF', 'Se destaca por  manejar y aplicar los conceptos de bases de datos planas y relacionales, tablas, formularios y otros elementos propios de las mimas. Felicidades continúa así.', 'Generalmente aplica los conceptos de bases de datos, tablas, formularios, etc.  ayuda en el proceso de construcción de tablas y participa regularmente de manera apropiada en clase. Trabaja un poco más.', 'En determinados casos aplica los conceptos vistos en clase de forma elemental limitándose a desarrollar actividades de forma parcial. Requiere mas dedicación.', 'Su desinterés es tan grande que confunde algunos conceptos desarrollando de forma incorrecta las actividades, se distrae mucho en clase impidiendo la entrega oportuna de sus guías. Debes estar más atento en clase.'),
(112, 'PRIMERO', '2', 'LC', 'Se destaca porque reconoce el concepto de narración, partes de la narración, elementos de la narración, la silaba, clasificación de las palabras según el número de silabas, raíz de las palabras y el acento.       ', 'Reconoce el concepto de narración,  partes de la narración, elementos de la narración,  la silaba, clasificación de las palabras según el número de silabas, raíz de las palabras y el acento.', 'Maneja moderadamente el concepto de narración, partes de la narración, la silaba, clasificación de las palabras según el número de silabas, raíz de las palabras y el acento. ', ':   Demuestra dificultad para manejar el concepto de narración, partes d la narración, la silaba, clasificación de las palabras según el número de silabas, raíz de las palabras y el acento.'),
