(114, 'PRIMERO', '8', 'INF', 'Desarrolla con facilidad las temáticas de tablas de contenido, ilustraciones, creación de bibliografías  referencias bibliográficas y comentarios, se esmera en realizar de forma correcta las actividades. Muy bien.', 'Hace buen uso de la creación de tablas de ilustraciones, bibliografías, referencias bibliográficas y comentarios,presentando falencias en la construcción de tablas de contenido. Animo. ', 'Son pocos sus esfuerzos por aplicar los conceptos vistos en su totalidad, presentando las actividades incompletas. Debes trabajar más.', 'Su irresponsabilidad y falta de interés le impidieron  alcanzar por lo menos la mitad de los logros propuestos. Además no presento a tiempo las actividades. Necesita practicar mucho en casa.'),
