(121, 'PRIMERO', '9', 'LCOM', 'Identifica con mucha facilidad mitos y leyendas colombianas y los aplica con eficacia en los textos narrativo e informativos. Felicitaciones ', 'Identifica con  facilidad mitos y leyendas colombianas y los aplica en la interpretación de los textos narrativo e informativos. Con un poco de esfuerzo puedes alcanzar la superioridad.  ', 'Algunas veces identifica  mitos y leyendas colombianas pero se le dificulta aplicarlos en los textos narrativo e informativos.Si se dedica mas obtendrá mejor rendimiento.', 'Demuestra dificultades en identificar mitos y leyendas colombianas, y no tiene claridad para aplicarlos en los textos narrativos e informativos. Debe dedicarse más a la asignatura.  '),
