(123, 'PRIMERO', '11', 'LC', 'Identifica con gran precisión las variables sociales de la lengua, reconociendo los roles discursivos en una situación del habla cotidiana. \nFelicitaciones!', 'Por lo general identifica las variables sociales de la lengua y reconoce los roles discursivos en una situación del habla cotidiana.\nTu capacidad de expresión es muy buena. Continua participando de esta manera.\n', 'Algunas veces logra identificar las variables sociales de la lengua y reconoce los roles discursivos en una situación del habla cotidiana.\nPresta más atención y se te facilitará la concentración de lo que haces.', 'Demuestra dificultades para identificar las variables sociales de la lengua y recocer los roles en una situación del habla cotidiana.Tu desinterés no te permite aportar positivamente en tus actividades.Mejora! '),
