(125, 'PRIMERO', '11', 'COMP', 'Frecuentemente pone en práctica las normas del manual de convivencia, mantiene buenas relaciones con los profesores y asume con mucha responsabilidad las orientaciones de sus superiores.', 'Pone en práctica las normas del manual de convivencia, mantiene buenas relaciones con los profesores y asume con responsabilidad las orientaciones de sus superiores.', 'En algunas ocasiones: pone en práctica las normas del manual de convivencia, mantiene buenas relaciones con los profesores y asume con poca responsabilidad las orientaciones de sus superiores.', 'Muy pocas veces; pone en práctica las normas del manual de convivencia, no mantiene buenas relaciones con los profesores y no asume con responsabilidad las orientaciones de sus superiores.'),
(126, 'PRIMERO', '6', 'INF', 'Demuestra gran habilidad en la creación de plantillas, bordes, marca de agua, color de página y aplicación de subíndices y superíndices. No te conformes con lo aprendido en clase.', 'Muestra interés por la aplicación de formatos para crear de forma oportuna y optima las actividades asignadas. Continúa con la práctica de los temas vistos.', 'Resuelve con algunas dificultades las actividades asignadas en clase sobre la creación de plantillas y aplicación de subíndices, superíndices. Necesitas reforzar las actividades.', 'Muestra poco interés en la clase y se le dificulta la creación de plantillas y aplicación de bordes, marca de agua, color de página, etc. Podría mejorar si atendiera más en clase y corrigiera su comportamiento.'),
(127, 'PRIMERO', '9', 'BIOAM', 'Se destaca por comprende la gran utilidad que tienen los conocimientos construidos por la genética para entender cómo se da la transmisión de los caracteres de una generación a otra. ', 'De manera apropiada comprende la gran utilidad que tienen los conocimientos construidos por la genética para entender cómo se da la transmisión de los caracteres de una generación a otra.', 'Moderadamente comprende la gran utilidad que tienen los conocimientos construidos por la genética para entender cómo se da la transmisión de los caracteres de una generación a otra.', 'Demuestra dificultades para comprender la gran utilidad que tienen los conocimientos construidos por la genética para entender cómo se da la transmisión de los caracteres de una generación a otra.'),
(128, 'PRIMERO', '2', 'ING6', 'En forma precisa, adecuada reconoce y produce oralmente, los articulo de la escuela como: table, teacher, pencil,  Realiza tareas y actividades propuestas en el salón de clase. Reconoce oral y escrito los números.', 'Moderadamente identifica  oral y escrito los articulo de la escuela como: table, teacher, pocas veces no entrega a tiempo las tareas. Para su buen desarrollo debe identificar los números del 1 al 50 en ingles.\n', 'Se le dificulta  reconocer  y producir  oralmente escribir los articulo de la escuela como: table, teacher, pencil, . Muy pocas veces  realiza actividades propuestas en el salón de clase.', 'Muy moderadamente se le dificulta  reconocer  y escribir los articulo de la escuela como: table, teacher, pencil, . Pocas veces realiza tareas y se le dificulta la realización de las  actividades en clase.'),
(129, 'PRIMERO', '5', 'INF', 'Realiza documentos de texto de alta calidad; adquiere destreza en el uso de  todas las opciones que brinda Word para edición de texto de gran utilidad. Felicidades.', 'Construye  y desarrolla documentos de texto aplicando diversas opciones de Word para lograr calidad en su formato, verificar la ortografía, usar sinónimos, encabezado y pie de página, entre otras. Animo.\n\n', 'A veces encuentra difícil el manejo de ciertas opciones y su correcta implementación, maneja las opciones básicas de Word y las aplica para mejorar el diseño de los documentos de texto. Esfuérzate más.\n\n', 'Demuestra dificultades en la inserción de encabezados, pie de páginas y ecuaciones, requiere practicar el uso de las opciones de Word para mejorar la ortografía. Este es el resultado de la falta de dedicación.'),
(130, 'PRIMERO', '10', 'BIOL2', 'Se destaca al reconocer cada una de las características de los diversos grupos taxonómicos; bacterias, protistos, hongos, plantas y animales.', 'De manera apropiada comprende cada una de las características de los diversos grupos taxonómicos; bacterias, protistos, hongos, plantas y animales.', 'Moderadamente reconoce cada una de las características de los diversos grupos taxonómicos; bacterias, protistas, hongos, plantas y animales.', 'Demuestra dificultades al reconocer cada una de las características de los diversos grupos taxonómicos; bacterias, protistas, hongos, plantas y animales.'),
(131, 'PRIMERO', '11', 'BIOL2', 'Comprende a la perfección las características de los diversos grupos taxonómicos; plantas y animales, sabe aplicarlo  en situaciones de la vida cotidiana. ', 'Comprende apropiadamente las características de los diversos grupos taxonómicos; plantas y animales, sabe aplicarlos  en situaciones de la vida cotidiana. ', 'Normalmente comprende las características de los diversos grupos taxonómicos; plantas y animales, se le dificulta aplicarlos  en situaciones de la vida cotidiana.', 'Tiene dificultades para comprender las características de los diversos grupos taxonómicos; plantas y animales, no tiene claridad al momento de aplicarlos  en situaciones de la vida cotidiana. '),
(132, 'PRIMERO', '9', 'QUI', 'Se destaca al clasificar correctamente las reacciones químicas, transformaciones y partículas transferidas, sabe aplicarlo  en situaciones de la vida cotidiana.', 'De manera apropiada clasifica correctamente las reacciones químicas, transformaciones y partículas transferidas, sabe aplicarlos  en situaciones de la vida cotidiana. ', 'Moderadamente clasifica correctamente las reacciones químicas, transformaciones y partículas transferidas, se le dificulta aplicarlos  en situaciones de la vida cotidiana. ', 'Demuestra dificultades al clasificar correctamente las reacciones químicas, transformaciones y partículas transferidas, no tiene claridad al momento de aplicarlos  en situaciones de la vida cotidiana. '),
(133, 'PRIMERO', '10', 'QUI1', 'Se destaca en el buen manejo e identificación de los conceptos de: materia, masa, peso, volumen, densidad, temperatura, soluciones y mezclas, los aplica  en situaciones de la vida cotidiana', 'De manera apropiada maneja e identifica los conceptos de: materia, masa, peso, volumen, densidad, temperatura, soluciones y mezclas, los aplica  en situaciones de la vida cotidiana. ', 'Moderadamente maneja e identifica los conceptos de: materia, masa, peso, volumen, densidad, temperatura, soluciones y mezclas, se le dificulta aplicarlos  en situaciones de la vida cotidiana.', 'Presenta dificultades para manejar e identificar los conceptos de: materia, masa, peso, volumen, densidad, temperatura, soluciones y mezclas, no tiene claridad al momento de aplicarlos.'),
(134, 'PRIMERO', '11', 'QUI2', 'Se destaca por diferenciar cada una de las propiedades fisicoquímicas de los gases y soluciones a través de la identificación de sus características, los aplica  en situaciones de la vida cotidiana. ', 'De manera apropiada diferencia cada una de las propiedades fisicoquímicas de los gases y soluciones a través de la identificación de sus características, los aplica  en situaciones de la vida cotidiana. ', 'Moderadamente diferencia cada una de las propiedades fisicoquímicas de los gases y soluciones a través de la identificación de sus características, se le dificulta aplicarlos  en la vida cotidiana.', 'Presenta dificultades para diferenciar cada una de las propiedades fisicoquímicas de los gases y soluciones a través de la identificación de sus características,no tiene claridad al aplicarlos en la vida cotidiana'),
(135, 'PRIMERO', '4', 'INF', 'Desarrolla de forma ágil las prácticas asignadas en clases, demostrando gran destreza en la creación, edición y formato de tablas. Practicar lo visto en casa para continuar con la excelencia.', 'Posee habilidades en el manejo de tablas en Word, realizando tablas y aplicando formato de forma rápida, es solidario con sus compañeros y respetuoso en clase. Necesitas reforzar más.', 'En ocasiones se le dificulta el manejo y aplicación de formato a las tablas,  dirección y ajuste del texto. Debes esforzarte más y alcanzaras el éxito.', 'Presenta falencias en la creación, edición y formato de tablas, se le dificulta organizar la información en las tablas. Podrías mejorar tu desempeño si tu atención en clase fuera mayor.'),
(136, 'PRIMERO', '3', 'ING6', 'Sobresale por Indagar, pronunciar  la identidad de los pronombres personales, lo describe en oraciones utilizando los verbos regulares tales como: run, jump, write, sleep, dance, realiza tareas y participa.', 'Se distingue por su cumplimiento en entrega de tareas y actividades sobre los diferentes temas: los verbos regulares, los pronombres y los números del 1 al 50 en ingles.\n', 'De manera regular reconoce los diferentes verbos regulares, escribe de manera dudosa oraciones con los pronombres personas, en ocasiones se le dificulta la escritura de los números del 1 al 50 en ingles.', 'Raras veces presta atención en clase, dificultándose le el desarrollo de los diferentes temas vistos en el periodo como: los verbos regulares, los pronombres y la pronunciación y escritura de los números. '),
(137, 'PRIMERO', '3', 'INF', 'Crea párrafos de alta calidad y con diversos estilos, demostrando habilidad y destreza en el uso de los elementos diseñados para ello en Word. Felicidades!', 'Conoce y maneja los elementos utilizados para darle estilo y formato  a los documentos creados, pero le falta más perfección para mejorar la calidad de los mismos. Continúa mejorando.', 'No presta suficiente atención a las explicaciones realizadas, por tanto muestra dificultad para aplicarle formato a los documentos realizados. Podría mejorar si está más atento a las explicaciones', 'Presenta dificultades para aplicarle formato a los documentos de texto creados, no reconoce ciertos elementos de la pestaña inicio usados para darle estilo y formato a los documentos de texto realizados.\n'),
(138, 'PRIMERO', '8', 'QUI', 'Identifica con mucha facilidad los conceptos de: nomenclatura química, valencia, estado de oxidación,iones y compuestos. Felicitaciones.', 'Identifica con facilidad los conceptos de: nomenclatura química, valencia, estado de oxidación,iones y compuestos. Dedíquese un poco mas. ', 'En algunas ocasiones Identifica los conceptos de: nomenclatura química, valencia, estado de oxidación,iones y compuestos. Con un poco de esfuerzo hubiese conseguido mejores resultados. ', 'Muy pocas veces Identifica los conceptos de: nomenclatura química, valencia, estado de oxidación,iones y compuestos.Este es el resultado de no haberse dedicado.'),
(139, 'PRIMERO', '4', 'ING6', 'Se destaca por poner en practica el uso de los pronombres personales con el verbo auxiliar going to, y would like to, entrega a tiempo tareas y participa activamente en clase. felicitaciones.', 'Realiza adecuadamente ejercicios con el uso de los pronombres personales con el verbo auxiliar going to, y would like to, entrega a tiempo tareas y participa activamente en clase. felicitaciones.', 'Pocas veces realiza adecuadamente ejercicios con el uso de los pronombres personales con el verbo auxiliar going to, y would like to,casualmente  entrega a tiempo tareas y participa pasivamente  en clase.', 'Se le dificulta realizar adecuadamente ejercicios con el uso de los pronombres personales con el verbo auxiliar going to, y would like to,pocas veces  entrega a tiempo tareas y participa pasivamente  en clase.'),
(140, 'PRIMERO', '2', 'INF', 'Maneja con gran destreza la redacción de documentos en Word e interactúa con ellos (seleccionar textos, cambiar de tipo y tamaño de fuente, conversión de mayúsculas y minúsculas). Felicidades!', 'Frecuentemente muestra interés y destreza en la redacción de documentos aplicándole formato a los mismos y manejo del teclado. Animo tu puedes llegar al nivel superior.', 'Realiza documentos de textos sencillos, presentando dificultades en alternar dos teclas al tiempo y manejo del teclado, tiene problemas con la ortografía en la redacción de documentos de texto. Debes esforzarte.', 'Tiene problemas con el manejo de la barra espaciadora en la edición de textos, mostró algunas dificultades en el reconocimiento de algunos elementos de la pestaña inicio en Word. Debes dedicarte mas.'),
(141, 'PRIMERO', '5', 'ING6', 'Por su buen nivel de conocimiento reconoce e identifica oralmente  los adjetive de manera orales y escritas, utiliza excelentemente oraciones de superioridad e igualdad. Entrega oportunamente las tareas.', 'Participar con entusiasmo en las actividades de diálogos  y exposiciones  de integración grupal. Maneja con poca dificultad the adjetive. Algunas veces entrega a tiempo las actividades propuestas en clase.', 'Maneja con  dificultad the adjetive en oraciones de igualdad y superioridad. pocas veces entrega a tiempo las actividades propuestas en el salón de clase. debes de esforzarte mas, tu puedes.', 'se le dificulta realizar ejercicios  the adjetive en oraciones de igualdad y superioridad. ocasionalmente entrega a tiempo las actividades propuestas en el salón de clase. de tu esfuerzo depende tu desempeño.  '),
(142, 'PRIMERO', '1', 'INF', 'Maneja con destreza el editor de texto WordPad e identifica las funciones del área de trabajo interactuando con ellas de forma eficiente. Felicidades!', 'Adquiere habilidad en el manejo del teclado y usa de forma correcta y eficiente el programa WordPad. Animo.', 'Se le dificulta realizar párrafos con rapidez, usando de forma correcta ciertas funciones del editor de texto WordPad y el manejo del teclado. Tu puedes ser mejor.', 'Presenta dificultad para usar el editor de texto WordPad y realizar de forma rápida documentos de texto. Necesitas esforzarte mas y practicar lo visto en clase.\n'),
(143, 'PRIMERO', 'T', 'INF', 'Adquiere destreza en el manejo del computador, identifica sus partes y maneja el teclado de forma correcta. Es respetuoso en clase y aplica las normas de comportamiento dentro del aula. Felicidades!\n', 'Conoce y diferencia las funciones básicas del computador y sus componentes principales, es respetuoso en clase  y solidario con sus compañeros. Animo tu puedes alcanzar el nivel superior.\n', 'Conoce y maneja las partes principales del computador, usando de forma correcta la mayoría de  teclas, presenta problemas con algunas normas de comportamiento dentro de la sala. Debes mejorar.\n', 'Tiene problemas con el encendido del computador, necesita refuerzo en el reconocimiento de algunas teclas de funciones básicas. Necesita refuerzo.\n'),
(144, 'PRIMERO', '1', 'CL', 'Por su buen dominio  demuestra habilidad para escribir diálogos e identificar técnicas y conversaciones en una narración; además reconoce y usa el orden de las palabras adecuadamente.', 'Por su completo  nivel de conocimiento demuestra habilidad para escribir diálogos e identificar técnicas y conversaciones en una narración; además reconoce y usa el orden de las palabras adecuadamente.', 'Algunas veces  reconoce y construye el significado del texto narrativo en la lectura, identifica técnicas, conversaciones y escritura en un dialogo; además enriquece su vocabulario mediante el uso de palabras. ', 'Raras veces  demuestra habilidad para escribir diálogos e identificar técnicas y conversaciones en una narración; además reconoce y usa el orden de las palabras debe de entregar a tiempo las actividades.'),
(145, 'PRIMERO', '2', 'LCOM', 'Se distingue porque demuestra entusiamo por la lectura, sobre todo cuando el contenido de la misma trae temas que son de su interés. ¡Felicitaciones! Continue asi.', 'Por lo general se interesa por la lectura, sobre todo si el contenido de la misma trae temas que son de su interés. ¡Felicitaciones! Siga asi  y alcanzara la excelencia.', 'Algunas veces se interesa por la lectura, sobre todo si el contenido de la misma trae temas que son de su interés. Eres muy inteleigente, solo te falta un poco mas de dedicacion, ¡Animate!', 'Se le dificulta bastante desarrollar el proceso de lectura aunque demuestra interés por superar esta dificultad. Si te esfuerzas mas de guro te ira mejor en el proximo periodo. ¡Pilas, tu puedes!'),
(146, 'PRIMERO', '2', 'REL2', 'Siempre reconoce que la amistad es una alianza para la vida y que por eso Dios  nos llama mantener una amistad con El y con los demás, y que con el pecado rechazamos la amistad con Dios. ¡Felicitaciones!', 'Reconoce que la amistad con Dios es una alianza para la vida y que por eso Dios nos llama a mantener una amistad con El y con los demás, y que con el pecado rechazamos la amistad con Dios. ¡Felicitaciones!', 'Algunas veces reconoce que la amistad con Dios es una alianza para la vida y que por eso Dios nos llama a mantener una amistad con El y con los demás, y que con el pecado rechazamos la amistad con Dios.', 'Se le dificulta reconocer que la amistad con Dios es una alianza para la vida y que por eso Dios nos llama a mantener una amistad con El y con los demás que  y que con el pecado rechazamos la amistad con Dios.'),
(147, 'PRIMERO', '2', 'SOC4', 'Se destaca porque define el concepto de comunidad,  establece diferencia entre las distintas comunidades de nuestro país,  entre barrio y  ciudad, y  porque reconoce la importancia de las fiestas patrias.', 'Generalmente define el concepto de comunidad,  establece diferencia entre las distintas comunidades de nuestro país,  entre  barrio y  ciudad, y  reconoce la importancia de las fiestas patrias.', 'Algunas veces define el concepto de comunidad,  establece diferencia entre las distintas comunidades de  nuestro país,  entre  barrio y ciudad, y reconoce la importancia de las fiestas patrias.   ', 'Demuestra dificultad para definir el concepto de comunidad y establecer diferencia entre  las distintas comunidades de nuestro país, entre  barrio y  ciudad, reconocer la importancia de las fiestas patrias.  '),
(148, 'PRIMERO', '2', 'COMCI', 'Identifica fácilmente los servicios públicos y sabe que la mayoría de las poblaciones y ciudades cuentan con estos servicios y que deben ser utilizados con responsabilidad. ¡ Felicitaciones !', 'Identifica los servicios públicos y sabe que la mayoría de las poblaciones y ciudades cuentan con estos servicios y que deben ser utilizados con responsabilidad. Si te lo propones lograras la excelencia...¡Animo!', 'Aveces identifica los servicios  públicos y sabe que la mayoría de poblaciones y ciudades cuentan con estos servicios y que deben ser utilizados con responsabilidad.  Si pones de tu parte te ira mejor...¡Animate!', 'Se le dificulta identificar los servicios públicos y saber que la mayoría de poblaciones cuentan con esos servicios y que deben ser utilizados con responsabilidad. Si te lo propones saldras adelante,  ¡tu puedes!.'),
(149, 'PRIMERO', '10', 'TRIG', 'Maneja con alto dominio las conversiones de sistema cíclico a sexagesimal y viceversa, construye con precisión los ángulos coterminales de un ángulo dado ubicándolo en el plano ,aplicando el teorema de pitagoras', 'Corresponde al trabajo asignado en clase demostrando interés por la asignatura y por los logros trazados, con un poco mas de esfuerzo puedes lograr la excelencia.', 'Cumple algunas veces con lo asignado dentro y fuera de clase, su falta de estudio le crea dudas que no le permiten avanzar y superar algunos logros aun supera regularmente la asignatura. Debes mejorar  ', 'Desarrolla con poca claridad ejercicios de aplicación propuestos en clase, no presenta trabajo ni tareas,  aportando cosas que no tiene que ver con la asignatura para tratar de evadir sus responsabilidades'),
(150, 'PRIMERO', '11', 'AM', 'Aplica correctamente las nociones del cálculo diferencial, ubicando intervalos en la recta real,  resolviendo inecuaciones lineales y cuadráticas por los diferentes métodos propuestos. Felicitaciones', 'Cumple adecuadamente con los trabajos y las tareas asignadas, pero demuestra dificultades en las evaluaciones debes tratar de esforzarte mas y lograras la superioridad', 'Tiene pocos hábitos de estudio presentando con dificultades trabajos y tareas asignadas  aun que alcanza los logros de manera regular su comportamiento y la indisciplina del grupo pueden llevarlo al desempeño bajo', 'Su desinterés  por la asignatura y su indisciplina lo llevan a no superar los logros, si no pone de su parte su aptitud puede llevarlo a repetir el grado '),
(151, 'PRIMERO', '6', 'LC', 'Produce con gran calidad,  textos escritos que responden a necesidades específicas de comunicación, a procedimientos sistemáticos de elaboración  estableciendo nexos intertextuales y extratextuales.', 'Produce con calidad  textos escritos que responden a necesidades especificas de comunicación, a procedimientos sistemáticos de elaboración  estableciendo nexos intertextuales y extratextuales.', 'Produce algunos textos escritos que responden a necesidades específicas de comunicación, a procedimientos sistemáticos de elaboración, donde  establece pocos nexos intertextuales y extratextuales.', 'Se le dificulta producir textos escritos que responden a necesidades específicas de comunicación,  con falta procedimientos sistemáticos de elaboración  sin establecer nexos intertextuales y extratextuales.'),
(152, 'PRIMERO', '5', 'COMP', 'DEMUESTRA CAPACIDAD PARA ACEPTAR EL MANUAL DE CONVIVENCIA. \nES CUIDADOSO EN LA PRESENTACIÓN PERSONAL Y CUMPLE RESPONSABLE MENT CON LOS DEBERES. MANEJA BUENAS RELACIONES CON LOS COMPAÑEROS, PROFESORES Y DIRECTIVOS', 'MANEJA MUY BUENA RELACIONES CON SUS COMPAÑEROS. RESPETA VALORA Y PARTICIPA CONSTANTEMENTE EN LAS DIFERENTES ACTIVIDADES ESCOLARES. \nFELICITACIONES POR TU COMPORTAMIENTO. \n', 'POCAS VECES HACE APORTES EFICIENTES AL TEMA. CASI SIEMPRE DEMUESTRA ESPÍRITU DE COLABORACIÓN Y SENTIDO DE PERTENENCIA CON EL COLEGIO. GENERALMENTE DEMUESTRA UN BUEN MANEJO DE RELACIONES INTERPERSONALES.', 'ES AGRESIVO CON SUS COMPAÑEROS CONSTANTEMENTE LOS MOLESTA. SE LEVANTA CONSTANTEMENTE DEL PUESTO Y DISTRAE A SUS COMPAÑEROS. SE LE DIFICULTE MANTENER BUENA RELACIÓN CON SUS COMPAÑEROS. \n'),
(153, 'SEGUNDO', '6', 'LC', 'Conoce  y utiliza con excelente dominio  estrategias argumentativas que \nposibilitan la construcción de textos orales en situaciones comunicativas auténticas\n', 'Conoce y utiliza de buena manera  estrategias argumentativas que \nposibilitan la construcción de textos orales en situaciones comunicativas auténticas\n', 'Conoce y utiliza  algunas estrategias argumentativas que \nposibilitan la construcción de textos orales en situaciones comunicativas auténticas\n', 'Posee poco conocimiento de las estrategias argumentativas que le \nposibiliten la construcción de textos orales en situaciones comunicativas auténticas\n'),
(154, 'PRIMERO', '2', 'COMP', 'Se distingue porque en el trato con sus compañeritos y con sus profesores se muestra respetuoso.  Su comportamiento en clases es excelente. ¡Felicitaciones! Continue asi.', 'En el rato con sus compañeritos y con sus profesores se muestra respetuoso.  Su comportamiento en clases es bueno. Continue asi.', 'Algunas veces en el trato con sus compañeros se muestra respetuoso.  Su comportamiento en clases es regular. Debe mejorar un poco su comportamiento.', 'Trata con agresividad sus compañeros, se muestra irrespetuoso con sus profesores. Su comportamiento en clases no e bueno. Debe cambiar de actitud y mejorar sus comportamiento.'),
(155, 'TERCERO', '6', 'LC', ' Comprende  claramente, obras literarias de diferentes géneros, propiciando así el desarrollo de mi capacidad crítica y creatividad. Felicidades, ser el mejor está muy cerca.', 'Comprende  de buena manera, obras literarias de diferentes géneros, propiciando así el desarrollo de mi capacidad crítica y creatividad. Con un poco mas de esfuerzo alcanzaras la meta', 'Comprende algunas obras literarias de diferentes géneros, propiciando así el desarrollo de mi capacidad crítica y creatividad. Seguir adelante con mucha precaución y dedicación.', 'Se le dificulta comprender, obras literarias de diferentes géneros,  para propiciar así el desarrollo de mi capacidad crítica y creatividad. Más dedicación en su trabajo y desarrollo cognitivo');
INSERT INTO `logro` (`idLogro`, `periodo`, `idGrado`, `idMateria`, `superior`, `alto`, `basico`, `bajo`) VALUES
(156, 'PRIMERO', '3', 'CN', 'Se destaca porque identifica el concepto de: seres vivos, características de los seres vivos,  reinos  monera,  protista y hongo, las plantas, clasificación de las plantas y partes de las plantas.          ', 'Identifica con facilidad el concepto de: seres vivos, características de los seres vivos, reinos monera,  protista y hongo, las plantas, clasificación de las plantas y partes de las plantas.', 'Algunas veces identifica el concepto de: seres vivos, características de los seres vivos, reinos  monera,  protista y hongo, las plantas, clasificación  de las plantas y partes de las plantas.', 'Demuestra dificultades para identificar el concepto de: seres vivos,  características de los seres vivos, reinos monera,  protista y  hongo,  las plantas, clasificación  y partes de las plantas.'),
(157, 'CUARTO', '6', 'LC', 'Con mucha seguridad reconoce en situaciones comunicativas auténticas, la diversidad y el encuentro de culturas, con el fin de afianzar  actitudes de respeto y tolerancia.', 'Con seguridad reconoce,  en situaciones comunicativas auténticas, la diversidad y el encuentro de culturas, con el fin de afi anzar  actitudes de respeto y tolerancia.', 'Parcialmente reconoce, en situaciones comunicativas auténticas, la diversidad y el encuentro de culturas, con el fin de afianzar actitudes de respeto y tolerancia.', 'Con poca actitud logra reconocer, en situaciones comunicativas auténticas, la diversidad y el encuentro de culturas, lo que le  dificulta afianzar actitudes de respeto y tolerancia'),
(158, 'PRIMERO', '3', 'AMB', 'Se distingue porque identifica con facilidad el concepto de medio ambiente, ecosistema y explica el papel de los seres vivos en los ecosistemas. ¡Felicitaciones!', 'De manera apropiada  identifica el concepto de  medio ambiente, ecosistema y explica el papel de los seres vivos en los ecosistemas. Con solo un poco mas de esfuerzo lograras la excelencia. ¡Animo!', 'Algunas veces  identifica el concepto de medio ambiente, ecosistema y explica el papel de los seres vivos en los ecosistemas. Debes esforzarte un poco mas y te ira  mejor en el segundo periodo. ', 'Demuestra dificultad para identificar el concepto de medio ambiente y explica el papel de los seres vivos en los ecosistemas. Debes esmerarte mas para que te vaya mejor en el proximo periodo.'),
(159, 'PRIMERO', '3', 'ET', 'Se distingue porque identifica claramente  que Ética es el estudio del comportamiento humano y  que  los valores   humanos son inherentes a nuestra condición humana. ¡Felicitaciones!', 'De manera apropiada identifica que Ética es el estudio del comportamiento humano y que los valores son inherentes a nuestra condición humana. Continue asi.', 'En algunas ocasiones identifica que Ética es el estudio del comportamiento humano y que los valores  humanos son inherentes a nuestra condición humana. Si te lo propones te ira  mejor en el proximo periodo.', 'Se le dificulta entender que Ética es el estudio del comportamiento humano y que los valores humanos son inherentes a nuestra condición humana. Debes esforzarte mas para el proximo periodo.              '),
(160, 'PRIMERO', '3', 'LCOM', 'Se distingue porque demuestra interés por la lectura, sobre todo cuando el contenido de la misma trae temas que son de su agrado. ¡Felicitaciones!', 'Por lo general se interesa por la lectura, sobre todo si el contenido de la misma trae temas que son de su agrado. Continue asi.', 'Algunas veces demuestra interés por la lectura, sobre todo si el contenido de la misma trae temas que son de su agrado. Debes esforzarte un poco mas para el proximo periodo.', 'Muy pocas veces demuestra interés por la lectura, incluso cuando el contenido de la misma rae temas que son de  su agrado. Debes pones mas empeño y dedicacion para que te vaya mejor el proximo periodo.'),
