(193, 'SEGUNDO', '11', 'CL', 'De forma brillante,  comprende el sentido global de cada uno de los textos que lee, la intención comunicativa de quien lo produce y las características del contexto que los produce.', 'De forma apropiada, comprende el sentido global de cada uno de los textos que lee, la intención comunicativa de quien lo produce y las características del contexto que los produce.', 'Comprende el sentido global de cada uno de los textos que lee, la intención comunicativa de quien lo produce y las características del contexto que los produce.', 'Su desinterés le impide, comprender el sentido global de cada uno de los textos que lee, distinguir  la intención comunicativa de quien lo produce y las características del contexto que los produce.'),
(194, 'TERCERO', '11', 'CL', 'Muestran gran interés, en la caracterización de los textos de acuerdo con la intención comunicativa de quien los produce.', 'Muestra buen  interés, en la caracterización de los textos de acuerdo con la intención comunicativa de quien los produce.', 'Caracteriza los textos de acuerdo con la intención comunicativa de quien los produce.', 'Se le dificulta demasiado, la caracterización de los textos según  la intención comunicativa de quien los produce.'),
(195, 'CUARTO', '11', 'CL', 'Con gran determinación, analiza los aspectos textuales, conceptuales y formales de los textos que lee, relacionándolo con su sentido global.', 'Con determinación, analiza los aspectos textuales, conceptuales y formales de los textos que lee, relacionándolo con su sentido global.', 'Analiza los aspectos textuales, conceptuales y formales de los textos que lee , relacionándolo con su sentido global.', 'con gran dificultad analiza los aspectos textuales, conceptuales y formales de los textos que lee, desconociendo la relación con su sentido global.'),
(196, 'PRIMERO', '10', 'COMP', ' Presenta una excelente disciplina en clase.  Acatando las sugerencias y observaciones de los profesores, para un mejor desempeño académico y mejora de la convivencia dentro y fuera del colegio.', 'Presenta una buena disciplina en clase.  Acatando las sugerencias y observaciones de los profesores, para un mejor desempeño académico y mejora de la convivencia dentro y fuera del colegio.', 'Presenta una moderada disciplina en clase.  Acatando las sugerencias y observaciones de los profesores, para un mejor desempeño académico y mejora de la convivencia dentro y fuera del colegio.', 'Presenta un marcado desinterés con su disciplina en clase.  ignorando las sugerencias y observaciones de los profesores, para un mejor desempeño académico y mejora de la convivencia dentro y fuera del colegio.'),
(197, 'PRIMERO', '9', 'ING5', 'Reconoce las estructuras de las oraciones del Presente Perfecto, must (deber) y have to (sinónimo deber) con ayuda del vocabulario, aplica los conceptos del tema asignado, asocia y combina.  Felicitaciones', 'Reconoce las estructuras de las oraciones en el presente perfecto, must (deber), have to (deber) aplica los conceptos del tema asignado, asocia y hace combinaciones de ejercicios.  Esfuérzate un poco mas.', 'En algunas ocasiones solo identifica palabras dentro de las estructuras en el presente perfecto, must (deber), have (deber). Preocupate por tus estudios y animo se que puedes lograrlo..', 'En algunas ocasiones no identifica, palabras, verbos de las oraciones y las estructura del Presente Simple.  Refuerza tus estudios y aplicate un poco mas'),
(198, 'PRIMERO', '10', 'ING5', 'Identifica fácilmente las estructuras de las oraciones en el pasado simple, y pasado continuo organiza fácilmente su vocabulario y lo asocia con las oraciones.   Felicitaciones.', ' Identifica fácilmente las estructuras de las oraciones en el pasado simple, y continuo organiza fácilmente su vocabulario y lo asocia con las oraciones.   Aplicate un poco mas.', 'En algunas ocasiones identifica palabras dentro de las estructuras del pasado simple, y continuo.  Animo con un poco mas de esfuerzo lo lograras.  ', 'En algunas ocasiones no identifica palabras dentro de las estructuras del pasado simple, y continuo. Aplicate a tus estudios y esfuerzate mas..'),
(199, 'PRIMERO', '11', 'ING5', 'Cambian fácilmente frases y oraciones en los diferentes tiempos verbales con facilidad al identificar sus estructuras de la forma correcta.  Felicitaciones', 'Cambian fácilmente frases y oraciones en los diferentes tiempos verbales con facilidad al identificar sus estructuras de la forma correcta.  Aplícate un poco mas.', 'En algunas ocasiones reconoce los cambios de las estructuras de los tiempos verbales y aplica un poco los conceptos.  Preocúpate mas por tus estudios, y animo lo puedes lograr.', 'En algunas ocasiones no relaciona los cambios de las estructuras de los tiempos verbales y aplica un poco los conceptos.  Preocúpate mas por tus estudios, y esfuérzate mas. '),
(200, 'PRIMERO', '6', 'COMCI', 'Domina totalmente el papel relevante en nuestra sociedad  actual ¡ FELICITACIONES !', 'Interpreta las actividades del papel relevante en nuestra sociedad actual Participe más de las actividades en clases.', 'Casi nunca analiza el papel relevante en nuestra sociedad actual Con un poco de esfuerzo conseguirá mejores resultados.', 'Su actitud es limitada para analizar el papel relevante en nuestra sociedad actual Este es el resultado de no haberse dedicado.'),
(201, 'PRIMERO', '7', 'COMCI', 'Desarrolla excelentemente los distintos tipos de derechos humanos en el ámbito conceptual. ¡ FELICITACIONES !', 'Hace buen uso de los distintos tipos de derechos humanos en el ámbito conceptual. Participe más de las actividades en clases.', 'Pocas veces analiza los distintos tipos de derechos humanos en el ámbito conceptual.  Con un poco de esfuerzo conseguirás tus objetivos.', 'Expresa sin claridad los distintos tipos de derechos humanos en el ámbito conceptual. Este es el resultado de no haberse dedicado.'),
(202, 'PRIMERO', '8', 'ET', 'Aplica correctamente las reglas universales de etiqueta. ¡FELICITACIONES !', 'Identifica con facilidad el concepto de las reglas universales de etiqueta. Dedíquese un poco más ', 'En algunas ocasiones identifica las reglas universales de etiqueta.  Con un poco de esfuerzo conseguirá mejores resultados', 'Muy pocas veces identifica las reglas universales de etiqueta. Este es el resultado de no haberse dedicado.'),
(203, 'PRIMERO', '6', 'ET', 'Reconoce y practica las reglas universales de la urbanidad. ¡Felicitaciones!', 'Promueve las reglas universales de la urbanidad. Participe mas de las actividades en clases.', 'Tiene pocas capacidades para comprender las reglas universales de la urbanidad. Dediquese mas al estudio.', 'Demuestra dificultades para comprender las reglas universales de la urbanidad. Este es el resultado de no haberse dedicado.'),
(204, 'PRIMERO', '7', 'ET', 'Difunde permanentemente las reglas universales de civismo. ¡FELICITACIONES !', 'Interpreta las reglas universales de civismo. Dedíquese un poco más ', 'Expresa con poca elocuencia las reglas universales de civismo.  Con un poco de esfuerzo conseguirás tus objetivos ', 'Expresa sin claridad las reglas universales de civismo. Este es el resultado de no haberse dedicado.'),
(205, 'PRIMERO', '6', 'COMP', 'su comportamiento es excelente, respetando a compañeros y profesores colaborando con todos los eventos de la institución. Felicitaciones', 'su comportamiento es bueno tolerando a sus compañeros y demostrando siempre entusiasmo en la institución  ', 'tiene pocos hábitos de estudio su mal comportamiento lo lleva a un mal rendimiento académico debes mejor para los siguientes periodos', 'su indisciplina constante y su falta de valores con sus compañeros, no son las mejores siempre busca la forma de evadir las responsabilidades escolares si no comienzas a interesarte por el estudio puedes ser expul'),
(206, 'PRIMERO', '9', 'ET', 'Difunde permanentemente el concepto de libertad desde la concepción. ¡ FELICITACIONES !', 'Demuestre actitudes en establecer relaciones el concepto de libertad desde la concepción. Dedíquese un poco más', 'Casi nunca establece relaciones el concepto de libertad desde la concepción.  Con un poco de esfuerzo conseguirá mejores resultados', 'Muy pocas veces establece relaciones el concepto de libertad desde la concepción. Este es el resultado de no haberse dedicado.'),
(207, 'PRIMERO', '10', 'ET', 'Se destaca por identificar el concepto de dignidad humana. ¡ FELICITACIONES !', 'Generalmente identifica el concepto de dignidad humana. Dedíquese un poco más', 'Tiene poca capacidad para identificar el concepto de dignidad humana.  Con un poco de esfuerzo conseguirá mejores resultados', 'Requiere mucho esfuerzo para identificar el concepto de dignidad humana. Este es el resultado de no haberse dedicado'),
(208, 'PRIMERO', '11', 'ET', 'Domina totalmente el concepto de autodominio. ¡FELICITACIONES !', 'Ejecuta regularmente el concepto de autodominio. Dedíquese un poco más ', 'Expresa con poca elocuencia el concepto de autodominio.  Con un poco de esfuerzo conseguirás tus objetivos ', 'Demuestra dificultades sobre el concepto de autodominio. ¡Ánimo, tú puedes!'),
(209, 'PRIMERO', '6', 'SOC4', 'Identifica con mucha facilidad el concepto de la teoría sobre el origen del universo y el sistema solar. ¡FELICIDADES !', 'Cumple con la mayor capacidad para reconocer el concepto de la teoría sobre el origen del universo y el sistema solar. Participe más de las actividades en clases ', 'Tiene pocos hábitos para identificar el concepto de la teoría sobre el origen del universo y el sistema solar.  Con un poco de esfuerzo conseguirá mejores resultados ', 'Demuestra dificultades para identificar el concepto de la teoría sobre el origen del universo y el sistema solar.  Este es el resultado de no haberse dedicado. '),
