(217, 'PRIMERO', '3', 'CL', 'Tiene capacidades para identificar aspectos específicos de un texto de acuerdo con diversos criterios predeterminados.\nFelicitaciones', 'Por lo general, tiene capacidad para identificar aspectos específicos de un texto de acuerdo con un criterio predeterminado.\nEjercita continuamente la lectura para mejorar capacidad interpretativa', 'Expresa con poca elocuencia algunos aspectos específicos de un texto de acuerdo con un criterio predeterminado.\nCon gran interés lograras mejor interpretación de los textos que leas', 'Demuestra dificultades para identificar algunos aspectos de un texto de acuerdo con un criterio predeterminado.\nSe hace necesaria la practica constante de lecturas que conlleven al análisis de las mismas. '),
