(219, 'PRIMERO', '3', 'GEO', 'Se destaca  porque  reconoce  y describe  y  nombra  perfectamente  algunos  sólidos  (  cono, esfera)\nConoce  muy   bien  las funciones  de cada  una  de las  manecillas  del  reloj .', 'Por  lo  general  reconoce    describe  y  nombra  algunos  sólidos(cono, esfera  ),  las  funciones  de  cada  una  de  las  manecillas  del  reloj.\n', 'Presenta  dificultad  al  describir  y  nombrar  algunos  sólidos  (cono  y  esfera), las  funciones  de  cada  una  de  las  manecillas del  reloj', 'Requiere  de  mucho  esfuerzo  para  describir  y  nombrar  algunos  sólidos (cono  y  esfera), y  las  funciones  de  cada  una  de  las  manecillas  del  reloj'),
(220, 'PRIMERO', '11', 'REL', 'Se distingue por sus participaciones constantes dentro de la clase mostrando seriedad y cumplimiento en sus deberes académicos y disciplinarios', 'Construye con acierto concepto sobre la religión y religiosidad, tiene respeto por las cosas sagradas y reconoce a la familia como la base de la sociedad', 'Cumple algunas veces con lo asignado en la clase mostrando desinterés por las cosas sagradas y su indisciplina en clase no le permite ser mejor', 'No siente aprecio por las cosas de Dios no respetas las cosas sagradas y no le interesa por ningún motivo la asignatura'),
