(222, 'PRIMERO', '9', 'CL', 'Desarrolla excelentemente la capacidad para emitir juicios sobre el contenido de un texto, reconociendo el tema principal, la organización textual y el propósito del autor.\nFelicitaciones', 'Por lo general, desarrolla la capacidad para emitir juicios sobre el contenido de un texto, reconociendo el tema principal, la organización textual y el propósito del autor.  Practica constantemente la lectura. ', 'Algunas veces desarrolla la capacidad para emitir juicios sobre el contenido de un texto, reconocer el tema principal, la organización textual y el propósito del autor.\n Lee con mayor interes', 'Requiere de mucho esfuerzo para poder emitir juicios sobre el contenido de un texto, reconocer el tema principal, la organización textual y el propósito del autor.\n Concéntrate mas en la lectura  '),
(223, 'PRIMERO', '11', 'SOC', 'Se distingue por su puntualidad y presentación de trabajos y talleres demostrando siempre interés por aprender felicitaciones', 'Cumple adecuadamente con lo propuesta en la asignatura durante este periodo con mas esfuerzo lograras la excelencia', 'Pocas veces cumple con trabajos y tareas tratando siempre de ganar la asignatura de la manera más fácil, debes tratar de ser más puntual con lo académico y la disciplina', 'El educando pose muchas limitaciones en cuanto a la asignatura no propone, no se interesas y  su constante indisciplina no le permiten superar los logros .animo puedes cambiar'),
(224, 'PRIMERO', '2', 'GEO', 'Se  distingue  porque identifica  algunas figuras  que  ruedan  y  las  que no  ruedan\nFELICITACIONES', 'De  manera  apropiada  identifica  algunas  figuras  solidas que  ruedan  y  las  que  no  ruedan', 'En  algunas  ocasiones identifica  algunas  figuras  solidas  que  ruedan  y  las  que  no  ruedan', 'Muy  pocas  veces  identifica   algunas  figuras  solidas  que  ruedan  y  las  que  no  ruedan\nDEBES  ESFORZARTE  MAS'),
(225, 'PRIMERO', '4', 'CL', 'se destaca por su buen desarrollo en comprensiones de lectura e interpretación de cada una de ellas  vistas en clase, entrega a tiempo tareas y trabajos, felicitaciones.', 'Desarrollo  con entusiasmo las comprensiones de lectura e interpretación de cada una de ellas  en el salon de  clase, entrega a tiempo tareas y trabajos, felicitaciones', 'presenta dificultad para desarrollar, comprender  e interpretar las lecturas realizadas en el salón, se le dificulta la entrega a  tiempo de  tareas y trabajos, esfuérzate tu puedes lograr ser el mejor..', 'pocas veces desarrolla, comprende  e interpreta las lecturas realizadas en el salón, se le dificulta la entrega a  tiempo de  tareas y trabajos, esfuérzate.'),
(226, 'PRIMERO', '9', 'COMP', 'Felicitaciones por tu desempeño, constancia y dedicación en el estudio.', 'Con un poco de esfuerzo puedes alcanzar la excelencia. Animo!', 'Con constancia e interés puedes mejorar en lo comportamental y mejoraras en Academia.', 'Debes esforzarte por tratar de mejorar tus relaciones con compañeros y docentes. Tu puedes!'),
(227, 'SEGUNDO', '10', 'COMP', 'Cumple con altísimo fidelidad, con todos los deberes establecidos en el manual de convivencia. su comportamiento escolar es excelente. Felicitaciones.', 'Cumple con mucha fidelidad,  con todos los deberes establecidos en el manual de convivencia. su comportamiento escolar es apropiado. ', 'Cumple a fidelidad con algunos de los deberes establecidos en el manual de convivencia. su comportamiento escolar es moderado. debe exigirse mas. ', 'Incumple con todos los deberes establecidos en el manual de convivencia. su comportamiento escolar es limitado, necesita mejorar su actitud frente a la vida.'),
(228, 'TERCERO', '10', 'COMP', 'Desarrolla armónicamente sus responsabilidades con la academia, disciplina y convivencia en pro de ser excelentes seres humanos. felicitaciones ', 'Desarrolla con claridad y armonía sus responsabilidades con la academia, disciplina y convivencia en pro de ser excelentes seres humanos. ', 'Algunas veces, desarrolla con claridad y armonía sus responsabilidades con la academia, disciplina y convivencia en pro de ser mejores seres humanos. ', 'Sus criterios niegan el desarrolla armónico de sus responsabilidades con la academia, disciplina y convivencia en pro de ser buenos seres humanos.  '),
(229, 'CUARTO', '10', 'COMP', 'Con lujo de detalles, representa el espíritu de lucha y liderazgo, por ser mejor cada día, ayudando permanentemente a sus compañeros y docentes en la construcción del verdadero conocimiento del ser.', 'Con buen detalle, representa el espíritu de lucha y liderazgo, por ser mejor cada día, ayudando permanentemente a sus compañeros y docentes en la construcción del verdadero conocimiento del ser.', 'Con pocos hábitos , representa el espíritu de lucha y liderazgo, por ser mejor cada día, ayudando permanentemente a sus compañeros y docentes en la construcción del verdadero conocimiento del ser.', 'Con escasez de detalles, desluce el espíritu de lucha y liderazgo, por ser mejor cada día, incomodando permanentemente a sus compañeros y docentes en la construcción del verdadero conocimiento del ser.');
