(230, 'PRIMERO', '10', 'INF', 'conoce adecuadamente la seguridad  dentro ciberespacio, y Muestra mucho interés en el Desarrollo habilidad para la realización de ejercicio de Excel. Presenta tareas y trabajos muy bien elaborados. ', 'conoce  la seguridad dentro ciberespacio y Cuestiona , analiza los argumentos de Desarrollo habilidad para la realización de ejercicio de Excel. Presenta tareas y trabajos a tiempo. ', 'conoce reglas basica para  seguridad dentro ciberespacio y Muestra en ciertas ocasiones  interés en Desarrollo habilidad para la realización de ejercicio de Excel Presenta tareas y trabajos ', 'conoce muy poco las reglas sobre la seguridad del ciberespacio y Muestra poco interés en Cuestionar Desarrollo habilidad para la realización de ejercicio de Excel'),
(231, 'PRIMERO', '11', 'INF', 'conoce adecuadamente la seguridad  dentro ciberespacio, Analiza correctamente Cuáles son las ventajas que poseen las redes de computadores y graficadores para la publicidad', 'conoce  la seguridad dentro ciberespacio, Analiza las redes de computadores y graficadores para la publicidad', 'conoce reglas básica para  seguridad dentro ciberespacio, Analiza y conoce al algunos conceptos de   las redes de computadores y graficadores para la publicidad', 'conoce muy poco las reglas sobre la seguridad del ciberespacio, poco conoce y  Analiza  al algunos conceptos de   las redes de computadores y graficadores para la publicidad'),
