(248, 'PRIMERO', '8', 'COMP', 'LOGRÓ UN EXCELENTE NIVEL DE FORMACIÓN Y DESARROLLO HUMANO. COMPARTE MUY BIEN SUS RESPONSABILIDADES Y ACEPTA LAS CONSECUENCIAS DE SUS ACTOS. FELICITACIONES.\n', 'SU FORMA DE SER ES UN EJEMPLO PARA LOS DEMÁS. EJERCE LIBREMENTE EL LIDERAZGO NECESARIO PARA EL CRECIMIENTO Y BIENESTAR DEL GRUPO. ES SOLIDARIO Y SE PREOCUPA POR AYUDAR A SUS COMPAÑEROS.  \n', 'EN OCASIONES ACTÚA CON AGRESIVIDAD EN EL TRATO CON LOS COMPAÑEROS.TIENE DIFICULTAD PARA CONTRIBUIR AL CRECIMIENTO Y BIENESTAR DEL GRUPO. GENERALMENTE EXAMINA SUS ACTITUDES Y COMPORTAMIENTO SIN ANALIZA.', 'SE LEVANTA CONSTANTEMENTE DEL PUESTO Y DISTRAE A SUS COMPAÑEROS, SE LE DIFICULTE MANTENER BUENA RELACIÓN CON SUS COMPAÑEROS, NO RESPETA LAS NORMAS DEL MANUAL DE CONVIVENCIA.'),
