(264, 'PRIMERO', '11', 'FIS2', 'Identifica  con mucha facilidad los conceptos de: M. A. S., los términos asociados y sus ecuaciones, y los aplica excelentemente en la solución de ejercicios y problemas de la vida cotidiana. Felicitaciones.', 'Identifica con  facilidad los conceptos de: M. A. S., los términos asociados y sus ecuaciones, y los aplica en la solución de ejercicios y problemas de la vida cotidiana. Si se dedica un poco más será superior.', 'En algunas ocasiones identifica los conceptos de: M. A. S, los términos asociados y sus ecuaciones,  pero se le dificulta aplicarlo  en la solución de ejercicios y problemas. Aplique mayor esfuerzo en el estudio.', 'Muy pocas veces identifica los conceptos de: M. A. S., los términos asociados y sus ecuaciones, y no tiene claridad para  aplicarlos  en la solución ejercicios y problemas de la vida diaria. Esfuérzate más,'),
(265, 'PRIMERO', '5', 'ET', 'De manera excelente demuestra habilidad para reconocer, aplicar e ilustrar valores como la dignidad, la tolerancia, la amistad, la honestidad y el amor en la familia, es responsables en la entrega de sus actidades', 'Por su buen dominio  demuestra habilidad , aplicar e ilustrar valores como la dignidad, la tolerancia, la amistad, la honestidad y el amor en la familia, no es constante en la entrega de sus actividades. ', 'Moderadamente  demuestra habilidad para reconocer, aplicar e ilustrar valores como la dignidad, la tolerancia, la amistad, la honestidad y el amor en la familia, no es constante en la entrega de sus actividades. ', 'Casi nunca  construye, reconocer, aplicar e ilustrar valores como la dignidad, la tolerancia, la amistad, la honestidad y el amor en la familia, no es constante en la entrega de sus actividades.'),
