(267, 'SEGUNDO', '1', 'AMB', 'Reconoce  e  identifica las  partes  de  una   planta .\nSabe  que la  raíz  es una  de  las  partes  más  importantes  de  las plantas.\nValora  y  cuida  el  medio ambiente', 'De  manera  apropiada identifica  las  partes  de  una  planta.\nPor  lo  general  sabe que  la  raíz  es  una  de  las  partes  más importante  de  una  planta-', 'Pocas  veces identifica  las  partes  de  una  planta.\nPor  lo  general  sabe que  la  raíz  es  una  de  las  partes  más importante  de  una  planta.\nParticipa  poco  en  clase', 'Se  le  dificulta identificar  las  partes  de  una  planta.\n sabe que  la  raíz  es  una  de  las  partes  más importante  de  una  planta-\nSu participación  en  clase es   muy  deficiente.'),
(268, 'SEGUNDO', '2', 'AMB', 'Se destaca porque maneja con propiedad el concepto de recursos naturales renovables y no renovables, sabe que debemos cuidarlos porque son necesarios para vivir y realizar nuestras actividades. Felicitaciones!', 'Generalmente maneja con propiedad el concepto de recursos naturales renovables y no renovables, y sabe que debemos cuidarlos porque son necesarios para vivir y realizar nuestras actividades. Continue asi.', 'Algunas veces maneja el concepto de recursos naturales renovables y no renovables, y sabe que debemos cuidarlos porque son necesarios para vivir y realizar nuestras actividdes. Si te esmeras un poco te ira mejor.', 'Se le dificulta manejar el concepto de recursos naturales renovables y no renovables, y saber que debemos cuidarlos porque son ecesarios para vivir y realizar nuestras actividades. Debes estudiar un pocomas.'),
(269, 'SEGUNDO', '6', 'COMCI', 'Domina totalmente el concepto de la  tenencia  de la tierra y las  expropaciones mediante sentencias   judicial  e indemnizacion previa. Felicitaciones.', 'Intepreta las actividades del concepto de la tenencia de la tierra y las expropiaciones mediante setencias judicial e indemnizacion previa. Partcipe mas de las  actividades en clase.', 'Casi nunca  analiza el concepto de la tenencia de la tierra y  las expropiaciones mediante setencias judicial e indemnizacion  previa. Con un poco de esfuerzo consiguiras mejores resultados.', 'Expresa sin claridad el concepto de la tenencia de la tierra y las expropiaciones mediante sentencias           judiciales e indemnizacion previa. Este es el resultado de no haberse dedicado'),
(270, 'SEGUNDO', '6', 'ARIT1', 'Se esmera por presentar trabajos y tareas, buscando siempre identificar números primos, compuestos, múltiplos y divisores,criterios de divisibilidad m.c.m M.c.d , en los números naturales. Felicitaciones  ', 'Generalmente muestra interés por aprender tratando siempre de mejorar sus distracciones en el aula de clase. Si te concentras  un poco mas podas lograras la excelencia', 'De forma regular presenta trabajos y tareas mostrando dificultades en los criterios de divisibilidad, m.c.m y M.c.d. si muestras mas interes por la asignatura lograras alcanzar todos los objetivos', 'No muestra interés por aprender , aplicando siempre las palabras no se, no la traje evadiendo siempre sus obligaciones académicas y su actitud frente a sus compañeros no es la mejor. Debes mejorar  '),
(271, 'SEGUNDO', '11', 'AM', 'Aplica correctamente los conceptos de funciones, sucesiones y series numéricas creando e interpretando las gráficas con exactitud si sigues así tendrás éxito en la vida felicitaciones', 'De forma acertada comprende los conceptos de funciones ,sucesiones y series numéricas e interpretando  gráficas lineales cuadradas cubicas etc. tratando siempre de superar las dificultades. animo puedes ser mejor', 'Regularmente comprende los conceptos de funciones, sucesiones y series numéricas tratando de interpretar gráficas lineales, cuadradas, cubicas etc. debes mejorar para alcanzar todos los logros. Animo', 'no comprende los conceptos de funciones ,sucesiones y series numéricas, no interpreta gráficas lineales, cuadradas, cubicas, etc por su falta de interés por la clases y la indisciplina, no alcanza los logros'),
(272, 'SEGUNDO', '6', 'ET', 'Domina totalmente el concepto de autenticidad y los problemas que pueden repercutir en la sociedad  apartir del  egocentrismo. Felicitaciones.', 'Interpreta el concepto de autenticidad y los problemas que pueden repercutir en la  sociedad  apartir del  egocentrismo.  Participe mas de las actividades en clase. ', 'Pocas veces analiza el concepto de la autenticidad  y los problemas que pueden repercutir en la sociedad  apartir del egocentrismo. Con un  poco de esfuerzo consiguiras tu objetivo.', 'Su actitud es limitada para analizar el concepto de autenticidad   y  los problemas que pueden repercutir en la sociedad apartir del egocentrismo.Este es el resultado de no  haberse dedicado.'),
(273, 'SEGUNDO', '10', 'TRIG', 'excelentemente define las funciones trigonométricas analizando cada una de sus gráficas y resolviendo ejercicios de aplicación en el triangulo rectángulo determinando ángulos lados y área. felicitaciones', 'Cumple adecuadamente con sus labores realizando trabajos con funciones trigonométricas,resolviendo ejercicios de aplicación en el triangulo rectángulo ,determinando lados y ángulos y área.Puedes ser mejor ', 'pocas veces cumple con las tareas y trabajos demostrando deficiencias en las funciones trigonométricas especialmente en la solución de triángulos rectángulos. Aunque alcanza algunos logros, debes mejorar', 'Su desinterés es tan grande que no propone nada en clase, no distingue las funciones trigonométricas y sus inversas no resuelve triángulos rectángulos y el área. por lo tanto no alcanza los objetivos '),
(274, 'SEGUNDO', '6', 'SOC4', 'Domina totalmente las caracteristcas fisicas externas e internas del planeta tierra y sus representaciones atraves de los diferentes tipos de  mapas. Felicitaciones.', 'Interpreta las caracteristicas fisicas externa e internas del planeta tierra y sus representaciones atraves de los diferentes tipos de mapas. Dediquese un poco mas.', 'Expresa con poca elocuencia las caracteristicas externas e internas del planeta tierra y  sus representaciones atraves de los  diferentes tipos de  mapas.Con un poco de esfuerzo consigueras tu  objetivos.', 'Expresa sin claridad las caracteristicas externas e internas del planeta tierra y sus representaciones atraves de los diferentes tipos de mapas.Este es el resultado de no haberse dedicado'),
(275, 'SEGUNDO', '6', 'COMP', 'su comportamiento es excelente, respetando a compañeros y profesores colaborando con todos los eventos de la institución y amor. Felicitaciones', 'su comportamiento es bueno y ayuda a sus compañeros y demostrando siempre entusiasmo en la institución  ', 'tiene pocos hábitos de estudio su mal comportamiento lo lleva a un mal rendimiento académico, debes mejorar para los siguientes periodos', 'su indisciplina constante y su falta de valores con sus compañeros, no son las mejores siempre busca la forma de evadir las responsabilidades escolares si no comienzas a interesarte por el estudio puedes ser expul'),
(276, 'SEGUNDO', '7', 'COMCI', 'Desarrolla excelentemente el  concepto equidad de genero, basado en la constitucion politica, donde promulga las libertades, los derechos y los deberes del hombre, sin distincion de raza y sexo.Felicitaciones.', 'Hace buen uso del concepto equidad de genero, basado en la constitucion politica donde promulga las libertades, los derechos y  los deberes del  hombre,  sin   distincion  de raza y sexo. Dedicase un poco mas.', 'En algunas ocasiones identifica el concepto de equidad de genero, basado  en la constitucion politica donde promulga las  libertades,  los derechos y los deberes del hombre.Un poco mas de  esfuerzo.', 'Demuestra dificultades  sobre el concepto de equidad de genero ,basado en la constitucion politica donde promulga las libertades, los derechos,  y las deberes del hombre.Este es el resultado de no haberse dedicado'),
(277, 'SEGUNDO', '7', 'ET', 'Difunde permanentemente los temas de la honestidad y la deshonestidad, apartir de los valores y los antivalores que se presenta en la sociedad moderna. Felicitaciones.', 'Interpreta los temas de la honestidad y la deshonestidad,apartir de los valores y los antivalores que se  presenta en sociedad moderna.Dediquese un poco mas.', 'Expresa con poca elocuencia los temas de la honestidad y la deshonestidad apartir de los valores y los antivalores que se presenta en la sociedad. Con un poco de esfuerzo consiguira tu objetivo.', 'Requiere de mucho esfuerzo para identificar la honestidad y la deshonestdad apartir de ls valores y los antivalores que se presenta en la sociedad moderna. Este es el resultado de no haberse dedicado.'),
(278, 'SEGUNDO', '7', 'SOC4', 'Se destaca por identificar los fenomenos migratorios, los problemas sociales y el estudio de la geografia regional. Felicitaciones.', 'Generalmente identifica los fenomenos migratorios,los problemas sociales y el estudio de la geografia regional. Dediquese un poco mas.', 'Tiene poca capacidad para identificar los fenomenos migratorios, los problemas sociales y estudio de la poblacion regional.Con un poco de esfuerzo consiguira tu objetivo.', 'Requiere de mucho esfuerzo para identificar los fenomenos migratorios, los problemas sociales y el estudio de la poblacion regional. Es el resultado de no haberse dedicado.'),
(279, 'SEGUNDO', '8', 'ET', 'Identifica con mucha facilidad  los diferentes tipos de corrupcion  que se presenta en los funcionarios publicos y la relevancia que tienen los valores etico para el ser humano. Felicitaciones.', 'Intepreta los diferente tipos de corrupcion que se presenta en los funcionarios publicos y la relevancia que tienen los valores etico para el ser humano. participe mas en las actividad en clase.', 'Tiene pocas capacidades para comprender los diferentes tipos de corrupcion que se presenta en los funcionarios publicos y la relevancia que tienen los valores etico para el ser humano. Dedicase mas al estudio.', 'Demuestra dificultades para comprender los diferentes tipos  de corrupcion que se presenta en los funcionarios publicos y la relevancia que tienen los valores etico para el ser humano. Mejora tu academia.'),
(280, 'SEGUNDO', '9', 'ET', 'Reconce las practicas y las actividades de la  reproduccion humana y el sexo sano de igual forma las enfermedades. Felicitaciones', 'Identifica las practicas y las actividades de la reproduccion humana y el sexo sano de igual forma las enfermedades.Dediquese un poco mas.', 'Tiene poca capacidad recocer las practicas y las actividades de la reproduccion humana y el sexo sano de igual forma las enfermedades.Con un poco de esfuerzo consiguira mejores resultado.', 'Expresa sin claridad en reconocer las practicas y las actividades de la reproduccion humana y el sexo seguro de igual forma las enfermedades.Este es el resultado de no haberse dedicado'),
(281, 'SEGUNDO', '9', 'GEO', 'Se destaca por su participación en clase desarrollando con rapidez y exactitud ejercicios de variaciones directas e inversas  resolviendo triángulos rectángulos utilizando el teorema de Pitagoras. Felicidades ', 'Cumple con la mayor parte de las tareas y los trabajos propuestos dentro del aula de clases y asignados fuera de ella ,resolviendo ejercicios de variación y teorema de pitagoras. Animo puedes ser superior ', 'Pocas veces cumple con los trabajos y tareas asignadas demostrando poco interés por la clase y fomentando el desorden en ocasiones con compañeros debes mejorar para poder superar los logros al cien por ciento', 'Jamas aporta algo productivo en clase tomando la palabra solo para interrumpir la clase y fomentar desorden, no presenta trabajos ni tareas. Debes ser mas responsable con la academia '),
(282, 'SEGUNDO', '10', 'ET', 'Se destaca por identificar las causas,  consecuencias,  los tipos de violencias  y el respeto a  las disferencias,en aprender a vivir en convivencia.Felicitaciones.', 'Generalmente identifica  las causas,consecuencias, los tipos de violencias y el respeto a las disferencias en aprender a vivir en  convivencia.Dedicase un poco mas.', 'Tiene pocos habitos para identifcar las causas,consecuencias, los tipos de violencia y el respeto a la disferencias en aprender a vivir en convivencias.Con un poco mas de esfuerzo consiguiras mejores resultados.', 'Demuestra dificultad para identificar las causas,consecuencias,los tipos de violencia y el respeto a la disferencia en aprender a vivir en convivencia. Este es el resultado de no haberse dedicado. '),
