(346, 'SEGUNDO', '4', 'LC', 'Se destaca por reconocer los conceptos de verbo y clases de verbos,un manejo adecuado de la ortografía,los artículos, las historietas,Empleándolo excelentemente en lecturas trabajada en clase.Felicitaciones', 'De manera apropiada reconoce los conceptos de verbo y clases de verbos,un manejo adecuado de la ortografía,los artículos, las historietas.Empleándolo en lecturas trabajadas en el aula de clase debes dedicarte mas', 'Pocas veces reconoce los conceptos de verbos y clase de verbos, un manejo no adecuado de la ortografía, los artículos, las historietas. Se le dificulta emplearlos en lecturas trabajadas en el aula de clase. ', 'Demuestra dificultad los concepto de verbos y clases de verbos,un manejo no adecuado de la ortografía,los artículos las historietas.Y no tiene claridad para emplearlos en lecturas trabajadas en clase.Dedíquese mas'),
