(348, 'SEGUNDO', '5', 'ARIT', 'Identifica con mucha facilidad de manejar  los conceptos de fracciones, fracciones equivalentes, orden de la fracción y todo lo relacionado con la unidad N 2 de la fracciones. Aplicándolos excelentemente ', 'Identifica con facilidad de manejar los conceptos de fracciones,fracciones equivalentes,orden de la fracción y lo relacionado con la unidad N°2 de fracciones.Aplicándolos en la solución de ejercicio.Esfuérzate mas', 'En algunas ocasiones identifica los conceptos de fracciones,fracciones equivalentes,orden de la fracción y lo relacionado con la unidad N 2 de fracciones. Se le dificulta aplicarlos en ejercicios. Preocúpate mas', 'Muy pocas veces identifica los conceptos de fracciones,fracciones equivalentes,orden de la fracción y lo relacionado con la unidad N2 de fracciones.No tiene claridad para aplicarlos en ejercicios. Esfuérzate mas '),
