(352, 'SEGUNDO', '5', 'LCOM', 'Se destaca por reconocer estructuras del texto,buscando significados de palabras,expresiones y oraciones relacionada con la lectura. Empleándolo excelentemente en actividades trabajada en clases. Felicitaciones ', 'De manera apropiada reconoce estructuras de textos, busca significados de palabras, expresiones y oraciones  relacionadas con la lectura. Empleándolo en actividades  trabajadas en el aula de clase debes dedicarte ', 'Pocas veces reconoce estructuras de textos,buscar significados de palabras,expresiones y oraciones relacionadas con lecturas.Se le dificulta emplearlos en actividades trabajadas en el aula de clase.Esfuérzate mas', ': Demuestra dificultad para reconocer estructuras de texto, buscar significados de palabras, expresiones y oraciones relacionadas con la lectura. No tiene claridad para emplearlos en actividades. tu puedes '),
(353, 'SEGUNDO', '5', 'SOC4', 'Se destaca por reconocer la hidrografía de Colombia, los distritos las épocas de la prehistoria, la época de colonia, la época de la conquista, la época de la independencia. Su manejo fue bueno continúe así.', ': De manera apropiada reconoce.Los distritos las épocas de la prehistoria, la época de colonia, la época de la conquista, la época de la independencia.Empleándolo en actividades trabajadas en clase. Esfuérzate mas', 'Pocas veces reconoce Los distritos las épocas de la prehistoria, la época de colonia, la época de la conquista, la época de la independencia.  Se le dificulta emplearlos en actividades. Preocúpate mas ', 'Demuestra dificultad para reconocer Los distritos las épocas de la prehistoria,la época de colonia,la época de la conquista,la época de la independencia.No tiene claridad para emplearlos en actividades.dediquese '),
(354, 'SEGUNDO', '1', 'ART2', 'Se destaca  por  que  sus  trabajos  son  muy  originales \nManeja  correctamente  la  técnica y la aplicación de algunos  colores.\nValora el trabajo de  sus compañeros', 'De manera apropiada se destaca  por  que  sus  trabajos  son  buenos\nPor lo general maneja   la  técnica y la aplicación de algunos  colores.\nValora el trabajo de  sus compañeros', 'Tiene poco habito al realizar sus actividades en clase\nCasi nunca  maneja   la  técnica y la aplicación de algunos  colores.\nValora el trabajo de  sus compañeros y comparte sus materiales', 'Tiene poco habito al realizar sus actividades en clase\nDemuestra dificultad al manejar   la  técnica y la aplicación de algunos  colores.\nValora el trabajo de  sus compañeros y comparte sus materiales'),
(355, 'SEGUNDO', '1', 'CN', 'Reconoce que los huesos forman parte del sistema oseo y que sostiene nuestro cuerpo.\nReconoce e identifica en su cuerpo las extremidades superiores e inferiores\nSabe perfectament la importancia que tiene el aseo', 'Por lo general reconoce que los huesos forman parte del sistema oseo\nAlgunas veces identifica en su cuerpo las extremidades superiores e inferiores.\nSabe perfectamente  la importancia que tiene el aseo', 'Tiene poco habito de estudio y pocas veces cumple con sus actividades\nAlgunas veces identifica en su cuerpo las extremidades superiores e inferiores.\nSabe la importancia que tiene el aseo', 'Tiene poco habito de estudio y pocas veces cumple con sus actividades\nDemuestra dificultad al  identificar en su cuerpo las extremidades superiores e inferiores.\nAporta poco en clase de los temas  visto.'),
(356, 'SEGUNDO', '1', 'COMCI', 'Participa activamente en actividades que contribuyen al bienestar comunitario.\nRespeta y valora las diferencias que existen entre las personas\nSabe que las normas  son muy importantes para una buena convivencia', 'Generalmente Participa activamente en actividades escolares\nPocas veces respeta y valora las diferencias que existen entre las personas\nSabe que las normas  son muy importantes para una buena convivencia', 'Casi nunca Participa  en actividades que contribuyan al bienestar comunitario\nPocas veces  respeta las personas que lo rodean\nPresenta con dificultades las actividades curriculares', 'Se le dificulta Participar  en actividades que contribuyan al bienestar comunitario\nPocas veces  respeta las personas que lo rodean\nPresenta con dificultades las actividades curriculares'),
(357, 'SEGUNDO', '7', 'ARIT2', 'De forma excelente resuelve potencias aplicando cada unas de sus propiedades, identificando también la radicacion ,hallando raíces enteras y con decimales. ademas resuelve ecuaciones de primer grado felicitaciones', 'Generalmente resuelve potencia confundiendo sus propiedades, identificando raíces enteras y decimales, resolviendo ecuaciones de primer grado con dificultades en ejercicios de aplicación. Puedes ser mejor   ', 'Regularmente intenta resolver potencias confundiendo sus propiedades, y se le dificulta encontrar raíces enteras y decimales también presenta problemas al resolver una ecuación de primer grado. Se puedes dar mas', 'demuestra dificultades para resolver una potencia y sus propiedades, no distingue la radicacion de la potenciacion ni resuelve ejercicios de aplicacion con ecuaciones de primer grado. Animo puedes mejorar'),
(358, 'SEGUNDO', '7', 'EST', 'construye con alto dominio gráficas estadística como (diagrama de barras, histogramas, polígonos de frecuencia, etc) interpretando cada una de ellas de manera excelente. Felicitaciones', 'Generalmente construye gráficas estadísticas como (diagrama de barras, histograma, polígonos de frecuencia, etc) aunque aveces falla al interpretarlas', 'En pocas ocasiones se preocupa por construir un gráfico estadístico mostrando deficiencias a la hora de interpretarlas si pones un poco mas de empeño puedes obtener mejores resultado ', 'su irresponsabilidad lo conlleva a  no superar los logros debes mostrar mas interés por la asignatura . Animo se que puedes dar lo mejor de ti y tendrás mejores resultado '),
(359, 'SEGUNDO', '7', 'GEO', 'De manera excelente identifica la amplitud de los ángulos y los reconoce entre lineas paralelas, ademas es creativo en su construcción y diferencia el circulo de la circunferencia .Felicitaciones', 'Generalmente reconoce la amplitud de los ángulos reconciendolos entre paralelas, se le dificulta diferenciar el circulo de la circunferencia. se que puedes dar mas', 'Regularmente reconoce los angulo su amplitud , entre paralelas confundiendo los conceptos de circulo y circunferencia debes ser mas creativo al construir dichas figuras. animo puedes mejorar', 'No reconoce los ángulos según su amplitud , posición y entre paralelas no propone nada en clase y su indisciplina lo llevan a esto resultados. no alcanza los logros.Debe mejorar para los periodos siguientes'),
(360, 'SEGUNDO', '11', 'ING5', 'Reconoce el vocabulario y las estructuras en Pasado Simple y Pasado Continuo al intercambiar expresiones escritas y orales. Felicitaciones', 'Reconoce el vocabulario y las estructuras en Pasado Simple y Pasado Continuo al intercambiar expresiones escritas y orales.  Sigue adelante con un poco de esfuerzo puedes lograr más.', 'Identifica parte del vocabulario en una estructura del Pasado Simple y Pasado Continuo, requiere un poco más de concentracion.  Animo se que puedes lograrlo.', 'No reconoce el vocabulario y parte de las estructuras en el Pasado Simple y Pasado Continuo, solo con la ayuda de un diccionario desarrolla las actividades.  Esfuerzate por conseguir las metas deseadas.'),
(361, 'SEGUNDO', '10', 'ING5', 'Realiza con facilidad las actividades en Presente Perfecto y Presente Perfecto Continuo, reconoce las estructuras y el vocabulario asignado al tema.  Felicitaciones ', 'Realiza con facilidad las actividades en Presente Perfecto y Presente Perfecto Continuo, reconoce las estructuras y el vocabulario asignado al tema.  Animo sigue adealnte y con un poco de esfuerzo lo lograras. ', 'Identifica solo parte del vocabulario y el tema asignado con ayuda de libro y diccionario en el caso del Presente Perfecto y Presente Perfecto Continuo.  Esfuerzate mucho se que lo puedes lograr.', 'No realiza las actividades en Presente Perfecto y Presente Perfecto Continuo al no reconocer sus estruturas y combinarlas al mismo tiempo, requiere de mucha ayuda con diccionarios y libros. Esfuerzate mas, animo.'),
(362, 'SEGUNDO', 'P', 'ARIT', 'Realiza correctamente el numero 1 y 2 e identifica las dimensiones largo corto alto bajo y el color azul felicitaciones ', 'Por lo general escribe el numero 1 y  2  e identifica las dimensiones largo corto alto bajo y el color azul\nAdelante tú puedes\n', ' En algunas ocasiones realiza el número 1 y 2  e identifica las dimensiones largo corto alto bajo y el color azul\nSigue adelante\n', 'Se le dificulta realizar el número 1 y 2  e identificar las dimensiones largo corto alto bajo y el color azul\nDedícate más a la asignatura \n'),
(363, 'SEGUNDO', 'J', 'ARIT', 'Realiza correctamente los números del 1 al 8e identifica las dimensiones largo corto alto bajo y el cuadrado como figuras geométricas\nFelicitaciones\n', 'Por lo general escribe el número del 1 al 8 e identifica las dimensiones largo corto alto bajo y el cuadrado como figuras geométricas\nAdelante tú puedes\n', 'Muy pocas veces realiza el número del 1 al 8e identifica las dimensiones largo corto alto bajo y el cuadrado como figuras geométricas\nSigue adelante\n', 'Requiere de mucho esfuerzo realizar los número del 1 al 8 e identifica las dimensiones largo corto alto bajo y el cuadrado como figuras geométricas\nDedícate más a la asignatura \n'),
