(369, 'SEGUNDO', '1', 'ET', 'Reconoce  y aplica  el  valor  del  respeto\nEs un niño  muy  respectuoso  con  sus familiares compañeros y  todas  las personas que  lo  rodean', 'Generalmente  aplica el valor  del  respeto con  todas las personas que  lo rodean.\nDe  manera apropiada  reconoce   y  aplica el  valor  del  respeto\n', 'Casi  nunca  aplica el  valor  del respeto  \nPocas  veces acepta  con    respeto a las  personas  que  lo rodean', 'Demuestra  dificultades  al  aplicar el valor  del respeto.\nActúa  con  poca  madurez  al  enfrentar  cualquier  situación  que se  le  presente.'),
(370, 'SEGUNDO', '1', 'GEO', 'Se  destaca    reconocer  las  caras    y  la forma  de las  caras de  los sólidos. \nIdentifica   los  cuerpos geométricos  que  ruedan  y  los  cuerpos geométricos  que  no ruedan.  \n\n', '  Por  lo  general  es bueno al   reconocer  las caras  y  la formas  de las caras  de los sólidos. \nDesarrolla  habilidades  motrices  al  trabajar  con  sólidos  que ruedan  y sólidos que  no  ruedan.', 'Maneja  moderadamente  los  sólidos  que  ruedan  y  los que  no  ruedan  cuando  los tiene en las manos.\nFrecuentemente es habilidoso al  reconocer  las  caras  y  las formas  de  las caras  de  los sólidos.', 'Muestra dificultas  al identificar   los  cuerpos geométricos  que  ruedan  y  los  que  ruedan.  \nFrecuentemente  presenta sus  actividades.'),
(371, 'SEGUNDO', '1', 'LC', 'Escribe  lee  e  identifica  inversos  y  combinaciones  trabajadas  en clase.\nTranscribe  y toma  dictados  correctamente  de todo  lo  que se realiza en  clase.\nTrabaja muy bien  en el  área  de español', 'De  manera apropiada escribe  lee  e  identifica  inversos  y  combinaciones  trabajados  en  clase\n  Por  lo  general  transcribe  y toma dictados  de  lo trabajado  en  clase.\n\n', 'Pocas veces transcribe y  toma  dictados de  lo trabajado  en  clase\nCasi  nunca   escribe  lee  e  identifica  inversos  y  combinaciones  trabajadas  en clase', 'Demuestra  dificultades  al  escribir  leer  e  identificar  inversos  y  combinaciones  trabajadas en clase.\nRequiere  de mucho  esfuerzo  al  para alcanzar  los logros propuestos para el  periodo.\n'),
(372, 'SEGUNDO', '1', 'SOC4', 'Reconoce  e identifica  las personas que trabajan  en el  colegio, y cada  una de sus dependencias,Su relación  con  las  personas  que  trabajan  en  el colegio  son excelente .', 'Generalmente  reconoce  e  identifica las personas  que  trabajan  en  el  colegio, y cada  una de sus  dependencias. Su relación \ncon  las personas  que trabajan  en  el  colegio son  excelentes.', '   Algunas  reconocer  e  identificar  las  personas que   trabajan  en  el  colegio,  y cada una de  sus dependencias. Su   relación con  las personas  que  trabajan en el  colegio son  buenas.\n', 'Se  le dificulta  reconocer  e  identificar  las  personas que   trabajan  en  el  colegio,  y cada una de  sus dependencias. Su   relación con  las personas  que  trabajan en el  colegio son  buenas.\n'),
(373, 'SEGUNDO', '1', 'LCOM', 'Analiza y  comprende    perfectamente historias  narradas en  clase.\nSe  destaca  por  su  buen manejo y  tono  de voz  al  leer   un  texto\nLee  un texto  corto  partiendo  y  siguiendo  imagenes.', 'De manera  apropiada  analiza y comprende  historias  narradas  en clase\nPor  lo  general  es  bueno  al leer  un  texto  corto.\nPocas veces  le  gusta leer en público', 'Pocas  veces  analiza  y  comprende historias  narradas en  clase.  \nCasi  nunca le  gusta  leer    en  público.\nAlgunas  veces  se preocupa  por adquirir  hábitos  de lectura', 'Demuestra  dificultades  al  leer  y analizar  cualquier  texto.\nRequiere  de mucho  esfuerzo  para poder  analizar y  comprender un  texto  leído  en clase\nSe le recomienda  pràcticar  lectura.'),
(374, 'SEGUNDO', '1', 'COMP', 'Se  destaca  por  ser  un niño  respetuoso  con sus compañeros y  profesores.\nSe distingue  por  ser sus habilidades   artísticas\nAcata  las ordenes impartidas  por sus  docentes', 'De manera   apropiada  es respetuoso con sus .compañeros  y profesores\nPor  lo general  acata  las ordenes impartidas por  sus profesores\n\n', 'Pocas veces  cumple  con  las ordenes  impartidas  por  las profesora\nSe  le dificulta  participar  en actividades lúdicas  dentro  del salón de clases\nAlgunas veces  es  muy  indisciplinado  en  clase', 'Demuestra dificultad  al  recibir ordenes  impartidas por  sus docentes\nSe  niega al intervenir  en  situaciones que  se  presenta  en  clase.\nEs  un  niño  muy indisciplinado en  clase.\n\n\n'),
(375, 'SEGUNDO', '2', 'ARIT', 'Se destaca  porque  identifica claramente  el  antecesor  y el sucesor  de un número\nEs eficiente al  establecer  secuencias   de  números  pares  e  impares\nRealiza sumas  de cuatro  cifras  llevando\n', 'De  manera   apropiada identifica  el antecesor  y  sucesor  de  un número.\nPor  lo  general  establece  secuencias    de  números pares  e  impares\nTiene  buena capacidad  para realizar sumas llevando', 'Casi  nunca  trabaja las actividades en  clase  \nRealiza con    mucha  dificultad  la      secuencia    de  números  pares  e impares\nIdentifica con dificultad  las  unidades del  mil  en  una cantidad\nl', 'Se le dificulta trabajar  las actividades  en clase, y  cumplir  con  sus  tareas\nDemuestra  dificultad  al realizar sumas llevando  de cuatro cifras\n'),
(376, 'SEGUNDO', '2', 'GEO', 'Reconoce  identifica y   nombra  figuras  planas, como  rectángulo, cuadrado  y  triángulo.\nDescribe  figuras  planas  teniendo  en cuenta el número  de lados     \n', 'Por  lo  general  es  bueno  al identificar  y  nombrar  figuras  planas.\nDe manera apropiada  describe  figuras  planas teniendo  en cuenta el número  de lados ', 'Pocas  veces  cumple  con sus  actividades \nSe  dificulta  reconocer  nombrar  e identificar  figuras planas\nPoco  cumple con  las actividades del texto\n\n', 'Muestra poco interés  en las actividades  realizadas  en clase\nSu irresponsabilidad  lo conlleva al bajo  rendimiento  académico\n\n'),
(377, 'SEGUNDO', '1', 'REL2', 'Acepta que la vida es creación  del  amor de  Dios\nComprende que  Jesús  nos  dio  ejemplo  de  humildad \nReconoce  que  la  familia  de  Nazaret  esta  compuesta  por   María  José  y  el  Niño Jesús.', 'De  manera  apropiada  acepta  y comprende  que  Jesús  nos  dio  ejemplo de  humildad.\nPor lo  general  acepta que  la vida es creación  del  amor  de  Dios.', '  Pocas  veces acepta  que  la vida  es  creación  del  amor   de Dios.\nAlgunas  veces  se  preocupa  por  cumplir  con  sus  actividades', 'Requiere  de  mucho  esfuerzo  para  aprender  más  de  los conocimientos religiosos\nDemuestra dificultades  al  trabajar  en  clase  y  cumplir  con  sus  deberes  escolares\n\n'),
(378, 'SEGUNDO', '3', 'GEO', 'Maneja  alto  dominio    en  la realización  de  ángulos\nSabe  perfectamente  que  los  ángulos  se  miden  en  grados dependiendo  de  la  unión  de  dos restas.\nLe  agrada  trabajar  en clase.', 'De  manera apropiada  realiza  ángulos\nPor  lo  general  sabe que  los  ángulos se miden  en  grados\nHace  un  buen  uso  de sus  implementos  de  trabajo  \n', 'Pocas veces cumple  con  sus actividades  e  implementos  de   trabajo.\nManeja moderadamente  la realización  de  ángulos  y  la medición  deestos', 'Demuestra dificultades  en  la realización de ángulos\nNo cumple con  sus actividades  a tiempo y  con   sus  útiles  de trabajo'),
(379, 'SEGUNDO', 'T', 'ING6', NULL, NULL, NULL, NULL);
INSERT INTO `logro` (`idLogro`, `periodo`, `idGrado`, `idMateria`, `superior`, `alto`, `basico`, `bajo`) VALUES
(380, 'SEGUNDO', '1', 'ING6', 'Reconoce con gran facilidad y conceptualiza las dependencias de la casa, ubicando su posición dentro de ella.\nFelicitaciones!', 'Demuestra interés por reconocer y conceptualizar las dependencias de la casa, y ubicar su posición dentro de ella.\nTu interés en el área te ayudara a seguir adelante.', 'Necesita de ayuda para reconocer y conceptualizar las dependencias de la casa y ubicar su posición dentro de ella.\nInterésate más en las actividades de ingles y te ira mejor!', 'Presenta dificultad para reconocer y conceptualizar las dependencias de la casa y ubicar su posición dentro de ella.\nConcéntrate con mayor atención en tus actividades de ingles y mejorara tu academia!'),
(381, 'SEGUNDO', '3', 'CL', 'Identifica sin dificultad el contexto en el que se desarrolla un texto, ubicando las ideas principales y expresando sus propias conclusiones.\nFelicitaciones', 'Muestra interés por identificar el contexto en el que se desarrolla un texto, ubicando sus ideas principales.\nAnimo, continua interesado en el área.', 'Requiere de ayuda para identificar el contexto en el que se desarrolla un texto, y ubicar las ideas principales del mismo.\nNecesita concentrarse más en el proceso de lectura. Animo.', 'Presenta dificultad para identificar el contexto en el que se desarrolla un texto, sus ideas principales y sus conclusiones.\nRequiere de gran concentracion en el proceso lector. tu puedes.'),
(382, 'SEGUNDO', '8', 'LCOM', NULL, NULL, NULL, NULL),
(383, 'SEGUNDO', '2', 'CL', 'Se destaca    porque  relaciona  saberes  y  experiencias  previas con  los temas de las lecturas  a realizar y lee comprensivamente\nen  forma silenciosa un  texto y  lo  explica. Felicitaciones!', '   Generalmente  relaciona  saberes  y  experiencias  previas con  los temas de las lecturas  a realizar y lee comprensivamente\nen  forma silenciosa un  texto y  lo  explca. Tu  puedes lograr la excelencia.', ' Algunas veces  relaciona  saberes  y  experiencias  previas con  los temas de las lecturas  a realizar y lee comprensivamente\nen  forma silenciosa un  texto y  lo  explica. ', 'Se le dificulta relacionar  saberes y experiencias  previas con los temas de  las lecturas a realizar y  leer comprensivamente\nen forma  silenciosa  un  texto y explicarlo. Debes dedicar mas tiempo a tus estudios'),
(384, 'SEGUNDO', '2', 'CN', 'Se distingue porque identifica el sistema digestivo,  respiratorio y circulatorio,  señala sus partes y valora  la importancia de cada uno. Felicitaciones, continue asi. ', 'Identifica el sistema digestivo, respiratorio y circulatorio, señala sus partes y valora la importancia de cada uno Continue asi.', 'Algunas veces  identifica el sistema digestivo, el respiratorio  y circulatorio, señala sus partes y valora la importancia de cada uno. Si te lo propones te ira mejor.', 'Se le dificulta identificar el sistema digestivo,  el respiratorio y el circulatorio, señalar sus partes y valorar la importancia de cada uno . Este es el resultado por tu falta dedicacion.\n'),
(385, 'SEGUNDO', '2', 'COMCI', 'Se destaca porque reconoce la importancia de establecer y cumplir normas para convivir con las demas personas y  comprende que la formacion ciudadana es fundamental para la convivencia cotidiana. Felicitaciones!', 'Reconoce la importancia de establecer y cumplir las normas para convivir con las demas personas y comprende que la formacion ciudadana es fundamental para la convivencia cotidiana. Coni.tinue as', 'Aveces reconoce la importancia de  establecer y cumplir las normas para convivir con las demas personas y comprende que la formacion ciudadana es fundamental para la convivencia cotidiana. Esmerate un poco mas.', 'Se le dificulta reconocer la importancia de establecer y cumplir las normas para convivir con las demas personas y comprender que la formacion ciudadana es fundamental para la convivencia cotidiana.'),
(386, 'SEGUNDO', '2', 'ET', 'Se distingue  porque maneja  apropiadamente el concepto de normas de comportamiento en el aula de clases y pone en práctica\nlas orientaciones dadas sobre el tema. Felicitaciones!', '   Maneja apropiadamente el concepto de normas de comportamiento en el aula de clases y pone en práctica\nlas orientaciones dadas sobre el tema. Continue asi.', ' Algunas veces maneja el concepto de normas de comportamiento en el aula de clases y pone en práctica\nlas orientaciones dadas sobre el tema. Pon mas empeño y te ira mejor.', ' Se le dificulta manejar  el concepto de normas de comportamiento en el aula de clases y poner en práctica\nlas orientaciones dadas sobre el tema. Debes dedicar mas tiempo a estudiar.'),
(387, 'SEGUNDO', '2', 'LC', 'Se destaca porque establece diferencia entre las clases de sustantivo, utiliza apropiadamente las palabras homófonas en los\ncontextos adecuados y respeta y atiende la opinión de los demás.   Felicitaciones!\n', 'Generalmente establece diferencia entre las clases de sustantivo, utiliza apropiadamente las palabras homófonas  en los contextos adecuados, y respeta y atiende la opinión de los demás. Continue asi', 'Aveces  establece diferencia entre las clases de sustantivo, utiliza apropiadamente las palabras homófonas en los contextos adecuados, y respeta y atiende la opinión de los demás. Animo,tu puedes dar mas.', 'Se le dificulta  establecer  diferencia entre las clases de sustantivo, utilizar apropiadamente las palabras homófonas en los contextos adecuados y respetar y atender la opinión de los demás. \n'),
(388, 'SEGUNDO', '2', 'SOC4', 'Se distingue porque fácilmente establece diferencias entre los trabajos del campo y la ciudad y porque valora la utilidad y la importancia de las vías y los medios de transporte para la comunidad.\n', 'Por los general  establece diferencia entre los trabajos del campo y la ciudad y valora la utilidad y la importancia de las vías y los medios de transporte para la comunidad.\n	\n', 'Aveces establece diferencia entre los trabajos del campo y la ciudad y valora la utilidad y la importancia de las vías y los medios de transporte para la comunidad.\n', 'Dificilmente  logra establecer  diferencia entre los trabajos del  campo y la ciudad y valorar la importancia de las vías y los medios de transporte para la comunidad'),
(389, 'SEGUNDO', '7', 'COMP', 'Con mucha facilidad comparte responsabilidades,participa constructiva-mente en actividades escolares y cumple con las labores académicas, respetando a sus compañeros y profesores. Felicitaciones.', 'Comparte responsabilidades y participa constructiva mente en actividades escolares, aunque aveces no cumple lo establecido en el manual de convivencia con mas entusiasmo puedes llegar a la superioridad', 'Con algunas dificultades comparte responsabilidades y participa constructiva mente en actividades escolares.su comportamiento es regular mostrando por momentos brotes de indisciplina con sus compañeros.', 'No se preocupa por compartir responsabilidades y su constante indisciplina y desordenes con compañeros dentro y fuera del aula de clase lo llevan a un rendimiento bajo. debes mejorar tu disciplina '),
(390, 'SEGUNDO', '6', 'EST', 'De forma precisa reconoce gráficas estadísticas como los diagramas de barras horizontales y verticales e interpretándolas y resolviendo preguntas. felicitaciones ', 'Generalmente reconoce gráficas estadísticas como los diagramas de barras horizontales y verticales', 'Regularmente reconoce gráficas estadísticas como los diagramas de barras horizontales y verticales', 'No reconoce los gráficos estadísticos , prestando poco atención a la clase y fomentando siempre el desorden. debes mejorar para el siguiente periodo'),
(391, 'SEGUNDO', '2', 'LCOM', 'Realiza interpretaciones de los textos que lee y expresa en forma clara sus ideas y sentimientos, según lo amerite la situación comunicativa. Felicitaciones!', 'De manera apropiada realiza interpretaciones de los textos que lee  y expresa en forma clara ideas y sentimientos, según lo amerite la situación comunicativa.  asi.', 'Algunas veces realiza interpretaciones de los textos que lee  y expresa en forma clara ideas y sentimientos, según lo amerite la situación comunicativa. Animo tu puedes dar mas.', 'Necesita refuerzo en la lectura para poder leer e interpretar textos y expresar en forma clara sus ideas y sentimientos segun lo amerite la situacion comunicativa.'),
(392, 'SEGUNDO', '8', 'BIOAM', 'Explica con precisión como se encuentran constituidos estructuralmente los órganos de los sentidos y sus funciones en el cuerpo humano. Felicitaciones.', 'Por lo general explica cómo se encuentran constituidos estructuralmente los órganos de los sentidos y sus funciones en el cuerpo humano. Participe más de las actividades en el aula de clases.', 'Algunas veces explica cómo se encuentran constituidos estructuralmente los órganos de los sentidos y sus funciones en el cuerpo humano. Si se dedica más obtendrá mejor rendimiento.', 'Demuestra dificultades al explicar cómo se encuentran constituidos estructuralmente los órganos de los sentidos y sus funciones en el cuerpo humano. Debe dedicarse más a la asignatura.  '),
(393, 'SEGUNDO', '9', 'QUI', 'Con mucha facilidad aplica las reglas para establecer el número de oxidación de los elementos químicos en los compuestos y reacciones químicas. Felicitaciones.', 'Por lo general aplica las reglas para establecer el número de oxidación de los elementos químicos en los compuestos y reacciones químicas. Participe más de las actividades en clases.', 'Algunas veces aplica las reglas para establecer el número de oxidación de los elementos químicos en los compuestos y reacciones químicas. Si se dedica más obtendrá mejor rendimiento.', 'Requiere de mucho esfuerzo al aplicar las reglas para establecer el número de oxidación de los elementos químicos en los compuestos y reacciones químicas. Debe dedicarse más a la asignatura.  '),
(394, 'SEGUNDO', '9', 'BIOAM', 'Con mucha facilidad identifica y diferencia las características de los ácidos nucleicos y su relación con el funcionamiento del cuerpo humano. Felicitaciones.', 'Por lo general identifica y diferencia las características de los ácidos nucleicos y su relación con el funcionamiento del cuerpo humano. Participe más de las actividades en clases.', 'Algunas veces identifica y diferencia las características de los ácidos nucleicos y su relación con el funcionamiento del cuerpo humano. Si se dedica más obtendrá mejor rendimiento.', 'Requiere de mucho esfuerzo al identificar y diferenciar las características de los ácidos nucleicos y su relación con el funcionamiento del cuerpo humano. Debe dedicarse más a la asignatura.  '),
(395, 'SEGUNDO', '10', 'BIOL2', 'Reconoce con mucha facilidad a los hongos y protistas por su estructura, clasificación, nutrición, respiración y su importancia ecológica. Felicitaciones.', 'Por lo general reconoce a los hongos y protistas por su estructura, clasificación, nutrición, respiración y su importancia ecológica. Participe más de las actividades en clases.', 'Algunas veces reconoce a los hongos y protistas por su estructura, clasificación, nutrición, respiración y su importancia ecológica. Si se dedica más obtendrá mejor rendimiento. ', 'Requiere de mucho esfuerzo al reconocer a los hongos y protistas por su estructura, clasificación, nutrición, respiración y su importancia ecológica. Debe dedicarse más a la asignatura.  '),
(396, 'SEGUNDO', '11', 'BIOL2', 'Con mucha facilidad reconoce aspectos relacionados con la nueva pirámide alimenticia, ácidos grasos y su importancia en el buen funcionamiento de nuestro organismo. Felicitaciones. ', 'Por lo general reconoce aspectos relacionados con la nueva pirámide alimenticia, ácidos grasos y su importancia en el buen funcionamiento de nuestro organismo. Participe más de las actividades en clases.', 'Algunas veces reconoce aspectos relacionados con la nueva pirámide alimenticia, ácidos grasos y su importancia en el buen funcionamiento de nuestro organismo. Si se dedica más obtendrá mejor rendimiento.', 'Requiere de mucho esfuerzo al reconocer aspectos relacionados con la nueva pirámide alimenticia, ácidos grasos y su importancia en el buen funcionamiento de nuestro organismo. Debe dedicarse más a la asignatura.  '),
(397, 'SEGUNDO', '10', 'QUI1', 'Con mucha facilidad aplica las matemáticas para realizar cálculos de masa molecular, moles, moléculas y átomos. Felicitaciones.', 'Por lo general aplica las matemáticas para realizar cálculos de masa molecular, moles, moléculas y átomos. Participe más de las actividades en clases.', 'Algunas veces aplica las matemáticas para realizar cálculos de masa molecular, moles, moléculas y átomos. Si se dedica más obtendrá mejor rendimiento.', 'Requiere de mucho esfuerzo al aplicar las matemáticas para realizar cálculos de masa molecular, moles, moléculas y átomos. Debe dedicarse más a la asignatura.  '),
(398, 'SEGUNDO', '8', 'QUI', 'Con mucha facilidad identifica y clasifica las funciones químicas: hidrocloruros, ácidos hidrácidos, óxidos, hidróxidos y ácidos oxácidos. Felicitaciones.', 'Por lo general identifica y clasifica las funciones químicas: hidruros, ácidos hidrácidos, óxidos, hidróxidos y ácidos oxácidos. Si se dedica más obtendrá mejor rendimiento.', 'Algunas veces identifica y clasifica las funciones químicas: hidruros, ácidos hidrácidos, óxidos, hidróxidos y ácidos oxácidos. Si se dedica más obtendrá mejor rendimiento.', 'Requiere de mucho esfuerzo al identificar, clasificar las funciones químicas: hidruros, ácidos hidrácidos, óxidos, hidróxidos y ácidos oxácidos. Debe dedicarse más a la asignatura.  '),
(399, 'SEGUNDO', '11', 'QUI2', 'Con mucha facilidad describe y aplica las características, propiedades y unidades de concentración de las soluciones en situaciones de la vida cotidiana. Felicitaciones.', 'Por lo general describe y aplica las características, propiedades y unidades de concentración de las soluciones en situaciones de la vida cotidiana. Participe más de las actividades en clases.', 'Algunas veces describe y aplica las características, propiedades y unidades de concentración de las soluciones en situaciones de la vida cotidiana. Si se dedica más obtendrá mejor rendimiento.', 'Requiere de mucho esfuerzo al describir y aplicar las características, propiedades y unidades de concentración de las soluciones en situaciones de la vida cotidiana. Debe dedicarse más a la asignatura.  '),
(400, 'SEGUNDO', 'T', 'INF', 'Adquiere destreza en el manejo del teclado, el mouse y el graficador de formas Paint de forma correcta. Es respetuoso en clase y aplica las normas de comportamiento dentro del aula. Felicidades!\n', 'Conoce y diferencia las funciones básicas del teclado  y el graficador de formas Paint, es respetuoso en clase  y solidario con sus compañeros. Animo tu puedes alcanzar el nivel superior.', 'Conoce y maneja las partes principales del teclado, usa de forma correcta la mayoría de  elementos que nos brinda el graficador de formas Paint, presenta problemas con algunas normas de comportamiento dentro de la', 'Tiene problemas con algunas teclas del teclado, necesita refuerzo en el reconocimiento de algunas funciones básicas en Paint. Necesita refuerzo.'),
(401, 'SEGUNDO', '1', 'INF', 'Maneja con destreza el graficador de formas Paint e identifica las propiedades que este le brinda para aplicarle a sus dibujos interactuando con ellas de forma eficiente. Felicidades!', 'Adquiere habilidad en la inserción de diferentes tipos de figuras aplicando de forma correcta las propiedades y diseño a las mismas. Animo.', 'Se le dificulta insertar formas al mismo tiempo que interactuar con las propiedades de las mismas para darle estilo. Tú puedes ser mejor.', 'Presenta dificultad para usar el graficador de formas Paint y realizar de forma rápida un dibujo libre y aplicarle sus propiedades. Necesitas esforzarte más y practicar lo visto en clase.'),
(402, 'SEGUNDO', '2', 'INF', 'Maneja con gran destreza la creación de diapositivas e interactúa con ellas aplicándole diseño. Inserta de manera adecuada formas y cuadros de texto aplicándole color, tamaño y estilo a los mismos. Felicidades!', 'Frecuentemente muestra interés y destreza en la inserción de formas en Power Point aplicándole formato, animación, diseño, transición, etc.  a las mismas. Animo tu puedes llegar al nivel superior.', 'Realiza presentación de diapositivas sencillas, presentando dificultades en la inserción de nuevas diapositivas con un estilo especifico, tiene problemas con las transiciones. Debes esforzarte.', 'Tiene problemas con el manejo de Power Point, mostró algunas dificultades en la aplicación  de algunos elementos de las transiciones y animaciones. Debes dedicarte más.'),
(403, 'SEGUNDO', '3', 'INF', 'Crea presentaciones de alta calidad y con diversos estilos, demostrando habilidad y destreza en el uso de los diagramas de venn en Power Point. Felicidades!', 'Conoce y maneja los elementos utilizados para darle estilo, animación y calidad a las presentaciones creadas, pero le falta más perfección en los diagramas de venn para mejorar las mismas. Continúa mejorando. ', 'No presta suficiente atención a las explicaciones realizadas, por tanto muestra dificultad en la creación y edición de las presentaciones realizadas. Podría mejorar si está más atento a las explicaciones.', 'Presenta dificultades para aplicarle diseño y animación a las presentaciones creadas, no maneja los diagramas de venn.'),
(404, 'SEGUNDO', '4', 'INF', 'Desarrolla de forma ágil las prácticas asignadas en clases, demostrando gran destreza en la creación y edición de presentaciones. Practicar lo visto en casa para continuar con la excelencia.', 'Posee habilidades en el manejo de animaciones, transiciones y diseño de diapositivas. Necesitas reforzar más.', 'En ocasiones se le dificulta el manejo y aplicación de animaciones, transiciones y diseño en la creación de diapositivas. Debes esforzarte más y alcanzaras el éxito.', 'Presenta falencias en la creación, edición de animaciones, transiciones y diseño de diapositivas. Podrías mejorar tu desempeño si tu atención en clase fuera mayor.'),
(405, 'SEGUNDO', '5', 'INF', 'Realiza búsquedas significativas en internet; organizando de manera adecuada la información solicitada extrayendo de ella lo más importante para el desarrollo del tema. Felicidades.', 'Tiene actitud especial en la utilización de los motores de búsqueda que nos brinda internet al momento de realizar una consulta aplicando los temas vistos en el periodo. Animo.', 'A veces encuentra difícil el manejo de ciertas opciones y su correcta implementación en los motores de búsqueda vistos. Esfuérzate más.', 'Demuestra dificultades en la utilización y aplicación de los motores de búsqueda en los temas vistos. Este es el resultado de la falta de dedicación.'),
(406, 'SEGUNDO', '6', 'INF', 'Demuestra gran habilidad en la construcción  de organigramas, diagramas de flujo y mapas conceptuales en el editor de presentaciones. No te conformes con lo visto en clase.', 'Muestra interés por la creación de organigramas, diagramas de flujo y mapas conceptuales. Continúa con la práctica de los temas vistos.', 'Resuelve con algunas dificultades los organigramas, diagramas de flujo y mapas conceptuales, todavía los confunde mucho. Necesitas reforzar las actividades.', 'Muestra poco interés en la clase y se le dificulta la creación de organigramas, diagramas de flujo y mapas conceptuales. Podría mejorar si atendiera más en clase y corrigiera su comportamiento.'),
(407, 'SEGUNDO', '7', 'INF', 'Muestra interés por adquirir conocimientos avanzados sobre la creación de diapositivas, va más allá de lo propuesto y siempre está en mira de mejorar. Felicidades  continúa así.', 'Identifica y maneja con propiedad la mayoría de elementos utilizados en la construcción de dispositivas. Continúa practicando para alcanzar la excelencia.', 'Maneja moderadamente el uso de ciertas herramientas de Power Point por realiza presentaciones de poca calidad. Necesitas reforzar  más.', 'Demuestra dificultades en creación de presentaciones en Power Point. Se distrae con gran facilidad, ocasionando retrasos en la entrega oportuna de las actividades. Requiere más esfuerzo.'),
(408, 'SEGUNDO', '8', 'INF', 'Desarrolla con facilidad presentaciones en Power Point aplicando todo lo visto en clase, se esmera en realizar de forma correcta las actividades. Muy bien.', 'Hace buen uso de la creación de presentaciones en Power Point, presentando falencias en la inserción de hipervínculos. Animo.', 'Son pocos sus esfuerzos por aplicar los conceptos vistos en su totalidad en la creación de presentaciones en Power Point, presentando las actividades incompletas. Debes trabajar más.', 'Su irresponsabilidad y falta de interés le impidieron  alcanzar por lo menos la mitad de los logros propuestos. Además no presento a tiempo las actividades. Necesita practicar mucho en casa.'),
(409, 'SEGUNDO', '9', 'INF', 'Se destaca por  manejar y elaborar  los modelos entidad/relación y el modelo relacional utilizando perfectamente los elementos propios de los mimos. Felicidades continúa así.', 'Generalmente construye de manera adecuada los modelos entidad/relación y el modelo relacional, ayuda en el proceso de construcción de modelos y participa regularmente de manera apropiada en clase. Trabaja un poco ', 'En determinados casos elabora de forma elemental los modelos entidad/relación y el modelo relacional limitándose a desarrollar actividades de forma parcial. Requiere más dedicación.', 'Su desinterés es tan grande que confunde algunos símbolos de los modelos vistos desarrollando de forma incorrecta las actividades, se distrae mucho en clase impidiendo la entrega oportuna de sus actividades. '),
(410, 'SEGUNDO', '9', 'EST', 'Obtiene e interpreta correctamente las tablas de frecuencias, el diagrama de barras, sectores, histogramas y pictogramas. Cumple siempre con sus tareas. Sigue así.', 'Cumple con la mayoría de las actividades asignadas, mostrando interés en clase y buen comportamiento. Maneja con pocas dificultades las tablas de frecuencia y gráficos estadísticos. Refuerza lo aprendido.', 'Algunas veces se preocupa por participar en clase y resolver los ejercicios asignados, pero supera satisfactoriamente la mitad de los logros esperados. Sigue trabajando, esfuérzate un poco más.', 'Desarrolla con poca precisión los logros trazados en la asignatura, en la resolución de tablas de frecuencia y gráficos estadísticos. Su desinterés e indisciplina le ha afectado en gran medida su rendimiento acadé'),
(411, 'SEGUNDO', '10', 'EST', 'Se apropia perfectamente de la elaboración e interpretación de tablas y gráficos estadísticos más usuales, aplicándolos correctamente en la solución de problemas de la vida cotidiana. Es brillante en sus aportes.', 'Interpreta y resuelve de manera adecuada las tablas de frecuencia, presentando fallas en la aplicación de algunas formulas y construcción de gráficos estadísticos. Esforzándote un poco lograras la excelencia.', 'Maneja moderadamente los temas de frecuencia y gráficos estadísticos, en determinados casos construye de manera correcta la tabla de frecuencia y sus gráficos. Animo.', 'Presenta poco interés en la realización de las actividades, sus habilidades con las tablas de frecuencia y los diagramas son muy limitadas. Esfuérzate un poco mas y veras mejores resultados.'),
(412, 'SEGUNDO', '11', 'EST', 'Domina totalmente los temas de frecuencia, moda, media, mediana, varianza y desviación típica al igual que representa gráficamente la información obtenida. Felicidades.', 'Generalmente maneja los temas de frecuencia, moda, media, mediana, varianza y desviación típica, mostrando dificultades en  la interpretación de los resultados para representarlos gráficamente. Animo.', 'En determinados casos resolvió los problemas de frecuencia, moda, media, mediana, varianza y desviación de forma correcta, demostrando poco interés para la interpretación de resultados y solución de gráfico. Animo', 'Requiere de mucho esfuerzo para hacer aportes en clase y desarrollar de forma correcta las actividades asignadas, no presenta trabajos ni tareas a tiempo. Debes tratar de mejorar para alcanzar los logros.'),
(413, 'SEGUNDO', '2', 'REL2', 'Realiza interpretaciones de los textos que lee y expresa en forma clara sus ideas y sentimientos, según lo amerite la situación comunicativa. Felicitaciones!', 'De manera apropiada realiza interpretaciones de los textos que lee  y expresa en forma clara ideas y sentimientos, según lo amerite la situación comunicativa. Continue asi.', 'Algunas veces realiza interpretaciones de los textos que lee  y expresa en forma clara ideas y sentimientos, según lo amerite la situación comunicativa. Animo tu puedes dar mas.', 'Necesita refuerzo en la lectura para poder leer e interpretar textos y expresar en forma clara sus ideas y sentimientos segun lo amerite la situacion comunicativa.'),
(414, 'SEGUNDO', '2', 'COMP', 'Se destaca porque  Siempre   demuestra muy buen comportamiento dentro del aula de clases  y trata en forma respetuosa a. sus profesores y a sus compañeros.  Continue  asi.', 'Generalmente demuestra buen comportamiento dentro y fuera del salon de clases y trata con respeto a sus profesores y a sus compañeros. Continue asi.', 'Algunas veces demuestra buen comportamiento  dentro y del  fuera aula de clase y trata a sus profesores y a sus  compañeros con mucho respeto.', ''),
(415, 'CUARTO', '4', 'CL', 'Tiene capacidad para identificar aspectos específicos de un texto de acuerdo con diversos criterios predeterminados.\nFelicitaciones!', 'Por lo general tiene capacidad para identificar aspectos específicos de un texto de acuerdo con un criterio predeterminado.\nEjercita continuamente la lectura para mejorar capacidad interpretativa. Animo!', 'Expresa con poca elocuencia algunos aspectos específicos de un texto de acuerdo con un criterio predeterminado.\nCon gran interés lograras mejor interpretación de los textos que leas. TU puedes!', 'Demuestra dificultades para identificar algunos aspectos de un texto de acuerdo con un criterio predeterminado. Es necesario la practica constante de lecturas que conlleven al análisis de las mismas. Inténtalo!'),
