(428, 'SEGUNDO', '9', 'ALG2', 'Evalúa con mucha facilidad determinantes 2x2 y 3x3  y aplica excelentemente la regla de Sarrus y de Cramer en la solución de problemas de la vida cotidiana. Felicitaciones.    \n                             \n', 'Evalúa con  facilidad determinantes 2x2 y 3x3  y aplica  la regla de Sarrus y de Cramer en la solución de problemas de la vida cotidiana. Dedíquese un poco más.', 'En algunas ocasiones evalúa  determinantes 2x2 y 3x3  y se le dificulta aplicar  la regla de Sarrus y de Cramer en la solución de problemas de la vida cotidiana. Estudie mucho más.', 'Muy pocas veces evalúa  determinantes 2x2 y 3x3  y no tiene claridad en aplicar  la regla de Sarrus y de Cramer en la solución de problemas de la vida cotidiana.Debe dedicarse más a la asignatura'),
(429, 'SEGUNDO', '3', 'AMB', 'Identifica con mucha facilidad los conceptos de factores no vivos o abioticos de un ecosistema y reconoce cada uno de sus componentes: clima, suelo y   agua. Durante este periodo su desempeño fue muy bueno. ', 'Identifica con  facilidad los conceptos de factores no vivos o abioticos de un ecosistema y reconoce cada uno de sus componentes: clima, suelo y agua. Durante este periodo su desempeño fue  bueno. ', 'En algunas ocasiones Identifica los conceptos de factores no vivos o abioticos de un ecosistema y reconoce cada uno de sus componentes: clima, suelo y agua. Con un poco mas de esfuerzo te habria ido mejor.', 'Muy pocas veces Identifica los conceptos de factores no vivos o abioticos de un ecosistema y reconoce cada uno de sus componentes: clima, suelo y agua. No pusiste de tu parte, por eso el resultado no fue bueno.'),
(430, 'SEGUNDO', '3', 'CN', 'Explica claramente  en  que consiste el Reino de las plantas, el Reino  animal y tiene la capacidad para explicar como es el ser humano, sus cambios y su dieta alimenticia.  ¡¡Felicitaciones!!\n', 'Explica  en  que consiste el Reino de las plantas, el Reino  animal y tiene la capacidad para explicar como es el ser humano, sus cambios y su dieta alimenticia.  Si te lo propones podrias alcanzar la excelencia\n', 'Explica  en  que consiste el Reino de las plantas, el Reino  animal y tiene la capacidad para explicar como es el ser humano, sus cambios y su dieta alimenticia.  Si te lo propones podrias alcanzar la excelencia  ', 'Algunas veces explica en  que consiste el Reino de las plantas, el Reino animal y tiene la capacidad para explicar como es el ser humano, sus cambios y su dieta alimenticia. Si pones de tu parte te ira mejor.'),
