(444, '', '3', 'COMCI', 'Permanente diferencia normas establecidas para con nosotros mismos, para con los demás y para con el público. Felicitaciones!', 'Generalmente diferencia normas establecidas para con nosotros mismos, para con los demás y para con el público. Continúa avanzando cada día más!', 'Algunas veces diferencia normas establecidas para con nosotros mismos, para con los demás y para con el público. Te animo a mejorar día a día, tú puedes!', 'Muestra inseguridad para diferenciar normas establecidas para con nosotros mismos, para con los demás y para con el público. Te invito a que trabajes en clase para que puedas mejorar tu rendimiento, ánimo!'),
