(447, '', '4', 'COMCI', 'Permanentemente difunde sus derechos y deberes y reconoce los mecanismos e instituciones que los hacen valer. Felicitaciones!', 'Generalmente difunde sus derechos y deberes y reconoce los mecanismos e instituciones que los hacen valer. Continúa avanzando cada día más!', 'Algunas veces difunde sus derechos y deberes y con regularidad reconoce los mecanismos e instituciones que los hacen valer. Te animo a mejorar día a día, tú puedes!', 'Pocas veces difunde sus derechos y deberes y con dificultad reconoce los mecanismos e instituciones que los hacen valer. Te invito a que trabajes en clase para que puedas mejorar tu rendimiento, ánimo!');
