(455, '', '7', 'QUI', 'Con gran facilidad explica el concepto de isótopo, ión, anión, catión y aplica la regla de la diagonal para la distribución electrónica de los elementos químicos. Felicitaciones!', 'De manera apropiada explica el concepto de isótopo, ión, anión, catión y aplica la regla de la diagonal para la distribución electrónica de los elementos químicos. Continúa avanzando cada día más!', 'Algunas veces explica el concepto de isótopo, ión, anión, catión y en ocasiones aplica la regla de la diagonal para la distribución electrónica de los elementos químicos. Te animo a mejorar día a día, tú puedes!', 'Muestra dificultad para explicar el concepto de isótopo, ión, anión, catión y para aplicar la regla de la diagonal que permite la distribución electrónica de los elementos químicos. Te invito a que trabajes en cla'),
(456, 'SEGUNDO', '2', 'ART2', 'Con lujo de detalle demuestra habilidad para diseñar y plasmar imágenes en el texto, emplea adecuadamente los colores primarios y secundarios, es hábil en la elaboración de manualidades. Felicidades.', 'Por su capacidad construye diseña y plasma imágenes en el texto, emplea de manera aceptable los colores primarios y secundarios, es hábil en la elaboración de manualidades.', 'De manera regular  construye, diseña y plasma imágenes en el texto, emplea de forma regular  los colores primarios y secundarios, ocasionalmente es hábil en la elaboración de manualidades. Debe mejorar.', 'Casi nunca  construye, diseña y plasma imágenes en el texto , No emplea adecuadamente  los colores primarios y secundarios, no demuestra  habilidad en la elaboración de manualidades. Con esfuerzo pu mejorar.'),
(457, 'SEGUNDO', '5', 'LC', 'Identifica facilmente el concepto de adverbio,  eufemismos y palabras tabu, la tilde diacritica y su funcion diferencial, identifica tambien las caracteristicas de un texto instructivo... Felicitaciones!! \n\n  ', 'Identifica el concepto de adverbio,  eufemismos y palabras tabu, la tilde diacritica y su funcion diferencial, identifica tambien las caracteristicas de un texto instructivo...Continue asi. \n', 'Algunas veces Identifica el concepto de adverbio, eufemismos y palabras tabu, la tilde diacritica y su funcion diferencial, identifica tambien las caracteristicas de un texto instructivo. Animo tu puedes dar mas\n', 'Muy pocas veces Identifica el concepto de adverbio, eufemismos y palabras tabu, la tilde diacritica y su funcion diferencial, ni las caracteristicas de un texto instructivo. Si te lo propones te ira mejor, Animo\n'),
