(461, 'SEGUNDO', '5', 'ART2', 'Con lujo de detalle demuestra habilidad para diseñar y plasmar imágenes en el texto y formatos, utiliza con excelencia los mezclas de colores fríos y cálidos, entrega puntualmente sus tareas. Felicitaciones.', 'Se distingue por  aprender, diseñar y plasmar imágenes en el texto y formatos, identifica y crea figuras simétricas y asimétricas, utilidad con destreza los colores fríos y cálidos. Mejora un poco mas.', 'Algunas veces, diseña y plasma imágenes en el texto y formatos, se le dificulta identificar y crear figuras simétricas y asimétricas, utilidad con poca destreza los colores fríos y cálidos. Esfuérzate mas.', 'Presta poco interés en diseñar y plasmar imágenes en el texto y formatos, no logra identificar ni crear figuras simétricas y asimétricas, emplea con dificultad  los colores fríos y cálidos. Debe mejorar..'),
(462, 'SEGUNDO', '6', 'ART2', 'Por su excelencia, diseña y plasma imágenes en el texto y formatos,  utilizando y aplicado con destreza de las diversas técnicas de dibujo y pintura aplicadas en clases. Felicitaciones.', 'Moderadamente construye, diseña y plasma imágenes en el texto y formatos, como también en la utilización  de las diversas técnicas de dibujo y pinturas aplicadas en clases. Entregar oportunamente sus trabajos.', 'De manera regular, diseña y plasma imágenes en el texto y formatos, como también en la utilización  de las diversas técnicas de dibujo y pinturas aplicadas en clases. Debe entregar oportunamente sus trabajos.', 'Se le dificulta, diseñar y plasmar imágenes en el texto y formatos, como también en la utilización  de las diversas técnicas de dibujo y pintura aplicadas en las actividades.  Debe esmerarse mas.'),
