(465, 'SEGUNDO', '4', 'COMCI', 'Permanentemente difunde sus derechos y deberes y reconoce la función de algunas instituciones que velan por el cumplimiento de los mismos. Felicitaciones!', 'Generalmente difunde sus derechos y deberes y reconoce la función de algunas instituciones que velan por el cumplimiento de los mismos. Continúa avanzando cada día más!', 'Algunas veces difunde sus derechos y deberes y en ocasiones reconoce la función de algunas instituciones que velan por el cumplimiento de los mismos. Te animo a mejorar día a día, tú puedes!', 'Pocas veces difunde sus derechos y deberes y no reconoce la función de algunas instituciones que velan por el cumplimiento de los mismos. Te invito a que trabajes en clase para que puedas mejorar!'),
