(467, 'SEGUNDO', '4', 'ING6', 'Se destaca por poner en practica el uso de los platos de comida, frutas y verduras en ingles, utiliza any y more en oraciones. entrega a tiempo tareas y participa activamente en clase. felicitaciones.', 'Pone en practica de manera acertada el uso de los platos de comida, frutas y verduras en ingles, utiliza any y more en oraciones. entrega a tiempo tareas y participa activamente en clase. felicitaciones.', 'Pocas veces pone en practica el uso de los platos de comida, frutas y verduras en ingles, utiliza any y more en oraciones. se le dificulta la entrega  a tiempo tareas y participa pocas veces en clase.', 'se le dificulta poner en practica el uso de los platos de comida, frutas y verduras en ingles, utiliza any y more en oraciones. se le dificulta la entrega  a tiempo tareas y participa pocas veces en clase.'),
(468, 'SEGUNDO', '5', 'ING6', 'Por su buen nivel de conocimiento reconoce e identifica oralmente el auxiliar have .-has de manera afirmativa, utilizándolo excelentemente en oraciones. Entrega oportunamente las tareas. felicitaciones.', 'Reconoce e identifica oralmente el auxiliar have .-has de manera afirmativa, utilizándolo excelentemente en oraciones. Entrega oportunamente las tareas. felicitaciones.', 'Se le dificulta reconocer e identificar oralmente el auxiliar have .-has de manera afirmativa, utilizándolo pocas veces en oraciones de manera correcta. se le dificulta la entrega oportuna de las tareas.', 'pocas veces reconoce e identifica oralmente el auxiliar have .-has de manera afirmativa, utilizándolo algunas veces en oraciones de manera correcta. se le dificulta la entrega oportuna de las tareas.'),
