(470, 'SEGUNDO', '9', 'CL', 'Establece con precisión la relación entre los contenidos de un texto y los contenidos de otros textos.\nFelicitaciones!', 'Generalmente establece la relación entre los contenidos de un texto y los contenidos de otros textos.\nConcéntrate mas en el proceso lector y éste se te facilitará mejor.', 'Algunas veces establece la relación entre los contenidos de un texto y los contenidos de otros textos.\nNecesita mayor interés en el proceso lector. Animo, tú puedes!', 'Demuestra dificultades para establecer la relación entre los contenidos de un texto y otro. Tu falta de interés y dedicación en el proceso lector no te permiten interpretar de manera correcta. Sigue adelante!'),
(471, 'SEGUNDO', '9', 'LC', 'Tiene capacidades para identificar las características principales del comentario de texto, analizarlo y emitir un juicio personal acerca del mismo.\nFelicitaciones!', 'Demuestra actitudes para identificar las características principales del comentario de texto, analizar y emitir un juicio personal acerca del mismo. Con gran interés de tu parte lograras con éxito la excelencia! ', 'Alunas veces logra identificar las características principales del comentario de texto, analizarlo y emitir un juicio personal acerca del mismo. Practicando constantemente la lectura lograras realizarlo. Animo!', 'Desarrolla con poca precisión la identificación de las características principales del comentario de texto, el análisis y la emisión de un juicio acerca del mismo. Concéntrate en lo que haces y saldrás adelante.'),
