(481, 'SEGUNDO', '5', 'AMB', 'Con gran facilidad explica  el concepto de desequilibrio ecológico e identifica las causas y consecuencias de este en el medio. ¡Felicitaciones!', 'Apropiadamente explica  el concepto de desequilibrio ecológico e identifica las causas y consecuencias de este en el medio. Continúa avanzando cada día más!', 'En determinados casos explica  el concepto de desequilibrio ecológico e identifica las causas y consecuencias de este en el medio. Te animo a mejorar día a día, tú puedes!', 'Muestra inseguridad para explicar  el concepto de desequilibrio ecológico e identifica las causas y consecuencias de este en el medio. Te invito a que trabajes en clase para que puedas mejorar tu rendimiento,ánimo'),
(482, 'SEGUNDO', '8', 'REL', 'se distingue por sus participaciones constantes dentro de la clase mostrando conocer el por què esta en el mundo y cumplimiento en sus deberes académicos y disciplinarios', 'construye con acierto concepto sobre el conocimiento de por què esta aqui, tiene respeto por las cosas sagradas ', 'cumple algunas veces con lo asignado en la clase mostrando desinterés por saber que hace en este mundo y su indisciplina en clase no le permiter ser mejor', 'no siente aprecio por las cosas de Dios no respetas las cosas sagradas y no le interesa saber quien es él.'),
(483, 'SEGUNDO', '9', 'REL', 'Se distingue por sus participaciones constantes dentro de la clase mostrando seriedad en el conocimiento de la moral y cumplimiento en sus deberes académicos y disciplinarios', 'Construye con acierto concepto sobre la moral, tiene respeto por las cosas sagradas y reconoce a la familia como la base de la sociedad', 'Cumple algunas veces con lo asignado en la clase mostrando desinterés por las cosas sagradas y sobrte la moral. su indisciplina en clase no le permite ser mejor', 'No siente aprecio por las cosas de Dios no respetas las cosas de Dios y no le interesa por ningún motivo la asignatura'),
(484, 'SEGUNDO', '10', 'REL', 'Se distingue por sus participaciones constantes dentro de la clase mostrando seriedad en la vida  y cumplimiento en sus deberes académicos y disciplinarios', 'Construye con acierto concepto sobre la religión y la vida, tiene respeto por las cosas sagradas y reconoce a la familia como la base de la sociedad', 'Cumple algunas veces con lo asignado en la clase mostrando desinterés por las cosas sagradas y la vidasu indisciplina en clase no le permite ser mejor', 'No siente aprecio por las cosas de Dios no respetas las cosas sagradas y no le interesa por ningún motivo la asignatura'),
(485, 'SEGUNDO', '5', 'ET', 'De manera excelente demuestra habilidad para reconocer, aplicar e ilustrar valores como la dignidad, la tolerancia, la amistad, la honestidad y el amor en la familia, es responsables en la entrega de sus actidades', 'Por su buen dominio  demuestra habilidad , aplicar e ilustrar valores como la dignidad, la tolerancia, la amistad, la honestidad y el amor en la familia, no es constante en la entrega de sus actividades. ', 'Moderadamente  demuestra habilidad para reconocer, aplicar e ilustrar valores como la dignidad, la tolerancia, la amistad, la honestidad y el amor en la familia, no es constante en la entrega de sus actividades. ', 'Casi nunca  construye, reconocer, aplicar e ilustrar valores como la dignidad, la tolerancia, la amistad, la honestidad y el amor en la familia, no es constante en la entrega de sus actividades..'),
(486, 'SEGUNDO', '8', 'COMCI', 'De manera excelente comprende y explica la importancia de los derechos fundamentales, económicos, sociales y culturales y colectivos y del medio ambiente así como los diferentes para mecanismo de protección.', 'Con propiedad comprende y explica la importancia de los derechos fundamentales, económicos, sociales y culturales y colectivos y del medio ambiente así como los diferentes para mecanismo de protección.', 'Con moderación  comprende y explica la importancia de los derechos fundamentales, económicos, sociales y culturales y colectivos y del medio ambiente así como los diferentes para mecanismo de protección.', 'Presenta dificultades en comprender  y explicar  la importancia de los derechos fundamentales, económicos, sociales y culturales y colectivos y del medio ambiente así como los diferentes de mecanismo de proteccion'),
(487, 'SEGUNDO', '8', 'SOC4', 'Con lujo de demuestra habilidad  para identificar las principales conceptos,causas y fenómenos demografía en Colombia, y en el estudio consecuencias de la minería  legal e ilegal para con el medio ambiente. .', 'Por su capacidad demuestra habilidad  para identificar las principales conceptos,causas y fenómenos demografía en Colombia, y en el estudio consecuencias de la minería  legal e ilegal para con el medio ambiente. .', 'De manera regular demuestra habilidad  para identificar las principales conceptos,causas y fenómenos demografía en Colombia, y en el estudio consecuencias de la minería  legal e ilegal para con el medio ambiente.', 'Casi nunca demuestra habilidad  para identificar las principales conceptos,causas y fenómenos demografía en Colombia, y en el estudio consecuencias de la minería  legal e ilegal para con el medio ambiente. .'),
(488, 'SEGUNDO', '10', 'COMCI', 'Por  su  nivel de conocimiento reconoce y construye el significado de los elementos y estructuras  del estado, derechos fundamentales colectivos y del medio ambiente, la acción de tutela, y acciones populares.', 'Por su buen dominio  demuestra habilidad en la construcción de concepto de los elementos y estructuras  del estado, derechos fundamentales colectivos y del medio ambiente, la acción de tutela, y acciones populares', 'Por  su  nivel de conocimiento reconoce y construye el significado de los elementos y estructuras  del estado, derechos fundamentales colectivos y del medio ambiente, la acción de tutela, y acciones populares.', 'Con moderación  reconoce y construye el significado de los elementos y estructuras  del estado, derechos fundamentales derechos  colectivos y del medio ambiente, la acción de tutela, y acciones popula'),
(489, 'SEGUNDO', '10', 'SOC', 'De manera excelente comprende y explica la importancia de los conceptos de contratos de contratos de trabajo, agentes, factores y actividades económicas así como la importancia de la división de trabajo.', 'Por su gran manejo comprende y explica la importancia de los conceptos de contratos de contratos de trabajo, agentes, factores y actividades económicas así como la importancia de la división de trabajo.', 'Regularmente  comprende y explica la importancia de los conceptos de contratos de contratos de trabajo, agentes, factores y actividades económicas así como la importancia de la división de trabajo.', 'Pocas veces comprende y explica la importancia de los conceptos de contratos de contratos de trabajo, agentes, factores y actividades económicas así como la importancia de la división de trabajo....'),
(490, 'SEGUNDO', '11', 'COMCI', 'Por  su  nivel de conocimiento reconoce  el significado de los elementos y estructuras  del estado, de los derechos de primera, segunda y tercera generación con su respectivo mecanismo de protección. ', 'Por su buen dominio  demuestra habilidad en la construcción de concepto de los elementos y estructuras  del estado, derechos de primera, segunda  y tercera generación así como mecanismos para su protección,  ', 'Por  su  nivel de conocimiento reconoce y construye el significado de los elementos y estructuras  del estado, derechos de primera, segunda  y tercera generación así como mecanismos para su protección,  ', 'Con moderación  reconoce y construye el significado de los elementos y estructuras  del estado, y derechos de primera, segunda  y tercera generación así como mecanismos para su protección,  '),
(491, 'SEGUNDO', '10', 'INF', 'Analiza correctamente las operaciones de suma, resta, porcentaje a que se pueden realizar en Excel. Felicitaciones.', 'Reconocer las operaciones de suma, resta, porcentaje, raíz y manejo de nomina que se pueden realizar en Excel. ', 'Analiza algunos •	Reconocer las operaciones de suma, resta, porcentaje, raíz y manejo de nomina que se pueden realizar en Excel ', ': Poco Analiza  •	Reconocer las operaciones de suma, resta, porcentaje, raíz y manejo de nomina que se pueden realizar en Excel. Debes mejorar en el estudio.'),
