(496, 'SEGUNDO', '5', 'CN', 'Se destaca por elaborar argumentos que explican la importancia de la función reproductiva y de relación para las especies. ¡Felicitaciones!', 'De manera apropiada elabora argumentos que explican la importancia de la función reproductiva y de relación para las especies. Continúa avanzando cada día más!', 'Regularmente  elabora argumentos que explican la importancia de la función reproductiva y de relación para las especies. Te animo a mejorar día a día, tú puedes!', 'Poco se preocupa por elaborar argumentos que expliquen la importancia de la función reproductiva y de relación para las especies. Te invito a que trabajes en clase para que puedas mejorar tu rendimiento, ánimo!'),
(497, 'SEGUNDO', '6', 'CNYA', 'Con gran facilidad explica la clasificación de organismos vivos en grupos taxonómicos. ¡Felicitaciones!', 'Apropiadamente explica la clasificación de organismos vivos en grupos taxonómicos. Continúa avanzando cada día más!', 'Regularmente explica  la clasificación de organismos vivos en grupos taxonómicos. Te animo a mejorar día a día, tú puedes!', 'Poco se preocupa por explicar la clasificación de organismos vivos en grupos taxonómicos. Te invito a que trabajes en clase y tener responsabilidad para que puedas mejorar tu rendimiento, ánimo!'),
(498, 'SEGUNDO', '6', 'QUI', 'Con gran facilidad explica los conceptos de sustancia pura, soluciones y mezclas, dando ejemplos de la vida cotidiana. Felicitaciones!', 'Generalmente explica los conceptos de sustancia pura, soluciones y mezclas, dando ejemplos de la vida cotidiana.Continúa avanzando cada día más!', 'Regularmente explica los conceptos de sustancia pura, soluciones y mezclas, dando ejemplos de la vida cotidiana.Te animo a mejorar día a día, tú puedes!', 'Muestra dificultad para explicar los conceptos de sustancia pura, soluciones y mezclas, y con inseguridad da ejemplos de la vida cotidiana.Te invito a que trabajes en clase para que puedas mejorar tu rendimiento!'),
(499, 'SEGUNDO', '7', 'BIOAM', 'Con gran facilidad explica estructuras y funciones de los sistemas digestivo y excretor del ser humano y propone cuidados para los mismos. Felicitaciones!', 'Generalmente explica estructuras y funciones de los sistemas digestivo y excretor del ser humano y propone cuidados para los mismos.Continúa avanzando cada día más!', 'Regularmente explica estructuras y funciones de los sistemas digestivo y excretor del ser humano y propone cuidados para los mismos.Te animo a mejorar día a día, tú puedes!', 'Con dificultad explica estructuras y funciones de los sistemas digestivo y excretor del ser humano y pocas veces propone cuidados para los mismos.Te invito a que trabajes en clase para que puedas mejorar!'),
