INSERT INTO `seguimiento` (`id`, `idPersona`, `fecha`, `mensaje`, `tipoSeguimiento`) VALUES
(1, '97111606963', '0000-00-00', 'db', 'DISCIPLINARIO'),
(2, '98070252252', '2014-04-25', 'No presento la actividad asignada en el día de hoy que representa una nota dentro del período', 'ACADEMICO'),
(3, '97040826045', '2014-04-25', 'No toma iniciativa de su parte en las actividades asignadas durante el desarrollo de la clase, espera que otros lo hagan y copia lo de sus compañeros.  ', 'ACADEMICO'),
(4, '97040826045', '2014-04-23', 'Durante la clase estuvo mucho tiempo de pie jugando con otro compañero y se tomo la iniciativa por parte del docente requerida continuar con la clase', 'DISCIPLINARIO'),
(5, '28252917', '2014-04-23', 'Durante la clase estuvo cambiandose de puesto constantemente interrumpiendo la actividad de los otros compañeros y jugando con otros compañeros de clase', 'DISCIPLINARIO'),
(6, '97040826045', '2014-06-05', 'El joven Cristian Samir Quintana debe mejorar en su actitud hacia la clase y sus actividades desarrolladas en la escuela, debe esforzarse por tomar iniciativas el solo sin la yuda de los demas', 'DISCIPLINARIO'),
(7, '1003231948', '2014-06-04', 'el alumno persiste con la indisciplina irrespetando sus compañeros y profesores y no presenta trabajos ni tareas, incumpliendo el compromiso firmado', 'DISCIPLINARIO'),
(8, '1193581561', '2014-06-04', 'el alumno persiste con bajo rendimiento académico incumpliendo el compromiso firmado en el primer periodo ', 'ACADEMICO'),
(9, '1003377700', '2014-06-04', 'el alumno sigue fomentando el desorden en clases y le inventa canciones a un compañeros con palabras ofensivas', 'DISCIPLINARIO'),
(10, '1003234485', '2014-06-04', 'el alumno persiste con la indisciplina y la la falta de interés por la academia , ademas inventa canciones ofensivas para sus compañeros', 'DISCIPLINARIO'),
(11, '1003390980', '2014-06-04', 'el alumno persiste con el bajo rendimiento académico y la indisciplina inventando canciones con palabras ofensivas para un compañero', 'DISCIPLINARIO');
